INSERT INTO `courses` (`id`, `title`, `slug`, `excerpt`, `content`, `is_active`, `category_id`, `extras`, `image`, `created_at`, `updated_at`, `is_free`, `rating`) VALUES
(7, 'Контент-план для Instagram (2021)', 'kontent-plan-dlya-instagram-2021', 'Контент-план-это ваша универсальная шпаргалка помощник на случай, если возникает вопрос - “Что мне сегодня публиковать в Instagram?”', '<p>Я бы советовал писать заранее 10-15 постов и держать их на готове. На случай, когда нет времени на написание новыхпубликаций.</p>', 1, 6, '', '', '2021-02-28 10:23:42', '2021-02-28 10:27:24', 1, 4),
(8, 'Как сделать x5 в запусках (2021)', 'kak-sdelat-x5-v-zapuskah-2021', 'Уже делаешь от 300 тыс. до 3 млн. за 1 запуск и хочешь масштабировать свои проекты в 5-10 раз за год;', '<p>Погряз в операционке и не можешь выделить время на семью и качественный отдых;<br />\r\nУ тебя нет конкретной цели на полгода/год по выручке и четкой схемы её достижения;<br />\r\n<br />\r\nНе знаешь, как упростить и масштабировать текущую схему запуска;<br />\r\nХочешь, чтобы запуски перестали тратить много твоих сил и нервов и стали полностью предсказуемыми.<br />\r\n<br />\r\nКАКОЙ РЕЗУЛЬТАТ ПОЛУЧИШЬ?<br />\r\n<br />\r\nОпределишь, какие главные страхи и ошибки мышления мешают тебе расти в выручке и эффективно делегировать;<br />\r\nПропишешь конкретную цель в доходе на год, выстроишь понятный путь к её достижению;<br />\r\nИзбежишь типичных ошибок в масштабировании, с которыми сталкивается каждый;<br />\r\nПолучишь 8-шаговую модель масштабирования в формате &quot;бери и делай&quot;.</p>', 1, 7, '', '', '2021-03-01 11:01:01', '2021-03-01 11:01:29', 1, 3),
(10, 'Продаван', 'prodavan', 'Краткое описание', '<p>папвпвп</p>', 1, 3, '', '', '2021-03-02 16:59:14', '2021-03-02 17:00:31', 1, 5),
(11, 'Лучшие приложения для обработки фото и видео', 'luchshie-prilozheniya-dlya-obrabotki-foto-i-video', 'Самые главные приложения для лучшей цветокоррекции', '<p>Очен большей текст</p>', 1, 1, '', '', '2021-03-03 07:04:26', '2021-03-03 07:04:26', 1, 4),
(12, 'Деньги-3: Создание бизнеса', 'konstantin-sheremetev-dengi-3-sozdanie-biznesa-kak-sdelat-mashinu-prinosyashchuyu-dengi', 'Константин Шереметьев. Как сделать машину, приносящую деньги. Курс рассчитан на 2 недели, ниже читайте подробный план по дням - что Вы узнаете из «Денег-3: Создание бизнеса»', '<p><em>Неделя 1. Механизм бизнеса</em><br />\r\nНа этой неделе вы узнаете, что такое бизнес.<br />\r\n<br />\r\nЗанятие 1. Элементы бизнеса</p>\r\n\r\n<ul>\r\n	<li>Нужна ли идея для бизнеса?</li>\r\n	<li>Отличие бизнеса от шопинга.</li>\r\n	<li>Типовые причины банкротства.</li>\r\n	<li>Как из элементов строится бизнес-машина.</li>\r\n</ul>\r\n\r\n<p>Занятие 2. Мастерство предпринимателя</p>\r\n\r\n<ul>\r\n	<li>Можете ли вы стать предпринимателем?</li>\r\n	<li>Два качества предпринимателя</li>\r\n	<li>Ценность времени.</li>\r\n	<li>Отношение к своим ошибкам.</li>\r\n	<li>Обанкротился, что дальше?</li>\r\n</ul>\r\n\r\n<p>Занятие 3. Рабочий день предпринимателя</p>\r\n\r\n<ul>\r\n	<li>Сделать самому или делегировать?</li>\r\n	<li>Что решаете только вы.</li>\r\n	<li>Какую информацию вы должны знать.</li>\r\n	<li>Метрики.</li>\r\n</ul>\r\n\r\n<p>Занятие 4. Сотрудники</p>\r\n\r\n<ul>\r\n	<li>Как набирать сотрудников</li>\r\n	<li>Как делать надежную фирму из ненадежных сотрудников</li>\r\n	<li>Как учить сотрудников.</li>\r\n	<li>Как разбирать конфликты.</li>\r\n	<li>Как увольнять сотрудников.</li>\r\n</ul>\r\n\r\n<p>Занятие 5. Пульт бизнеса</p>\r\n\r\n<ul>\r\n	<li>Как управлять бизнесом</li>\r\n	<li>Три типа клиентов вашего бизнеса</li>\r\n	<li>Как проверять работу?</li>\r\n	<li>Контроль качества</li>\r\n</ul>\r\n\r\n<p>Занятие 6. Конвейер бизнеса</p>\r\n\r\n<ul>\r\n	<li>База клиентов.</li>\r\n	<li>Оферы, оферы, оферы</li>\r\n	<li>Тестирование</li>\r\n	<li>Как слушать клиентов?</li>\r\n</ul>\r\n\r\n<p><em>Неделя 2. Развитие бизнеса</em><br />\r\nНа этой неделе вы получите пошаговые инструкции по развитию бизнеса с полного нуля.<br />\r\n<br />\r\nЗанятие 7. Бизнес на каждый день</p>\r\n\r\n<ul>\r\n	<li>С чего начинать?</li>\r\n	<li>Какую фирму открывать?</li>\r\n	<li>Планирование недели</li>\r\n	<li>Юридическое сопровождение</li>\r\n	<li>Бухгалтерское сопровождение</li>\r\n</ul>\r\n\r\n<p>Занятие 8. Треугольник бизнесмена</p>\r\n\r\n<ul>\r\n	<li>С чего начинается утро?</li>\r\n	<li>На что обращаем внимание?</li>\r\n	<li>Как принимаем решения</li>\r\n</ul>\r\n\r\n<p>Занятие 9. Неделя бизнесмена</p>\r\n\r\n<ul>\r\n	<li>Метрики бизнеса</li>\r\n	<li>Маркетинг</li>\r\n	<li>Первая продажа</li>\r\n</ul>\r\n\r\n<p>Занятие 10. Учет всего</p>\r\n\r\n<ul>\r\n	<li>Доходы и расходы</li>\r\n	<li>Качество.</li>\r\n	<li>Обучение сотрудников.</li>\r\n	<li>Лояльность покупателей</li>\r\n</ul>\r\n\r\n<p>Занятие 11. Масштабирование бизнеса</p>\r\n\r\n<ul>\r\n	<li>Стратегические совещания</li>\r\n	<li>Когда нанимать сотрудников?</li>\r\n	<li>Топ-менеджмент</li>\r\n	<li>Как искать самые прибыльные направления?</li>\r\n</ul>\r\n\r\n<p>Занятие 12. Бизнес-машина</p>\r\n\r\n<ul>\r\n	<li>Как сделать бизнес-машину автономной.</li>\r\n	<li>Как управлять управленцами?</li>\r\n	<li>Как оставаться на рынке в любых ситуациях?</li>\r\n</ul>', 1, 7, '', '', '2021-03-03 09:25:35', '2021-03-03 10:57:16', 1, 5),
(13, 'Бизнес на фотомагнитах', 'biznes-na-fotomagnitah', 'Для мам в декретном отпуске, для студентов и тех кто действительно готов зарабатывать.', '<p>4 уникальных видео ролика, презинтация работ, список поставщиков и детали - с чего же начать? Ничните с просмотра роликов ниже.</p>', 1, 7, '', '', '2021-03-03 09:54:27', '2021-03-03 10:02:36', 1, 4),
(14, 'Бизнес в стиле «Макдоналдс»', 'biznes-v-stile-makdonalds', 'Как превратить вашу компанию в стабильно работающий механизм', '<p><strong>&laquo;Макдоналдс&raquo;</strong>&nbsp;&ndash; отличная школа менеджмента, продуманные и выстроенные до мелочей производственные процессы. Благодаря четким стандартам компания добивается их идеальной синхронизации. Можно ли перенести этот опыт и практики в свою компанию и создать бизнес-фабрику в стиле &laquo;Макдоналдс&raquo;?<br />\r\n<br />\r\nОпираясь на многолетний управленческий опыт работы в &laquo;Макдоналдс&raquo;, &laquo;Додо Пицце&raquo;, &laquo;Вилгуд&raquo;, предприниматель Марсель Зиганшин утверждает: в какой бы сфере вы ни работали, свой &laquo;Макдоналдс&raquo; можно построить везде.<br />\r\nКнига состоит из трех основных частей: &laquo;Команда&raquo;, &laquo;Эффективность и управление&raquo; и &laquo;Клиент&raquo;. Именно эти три составляющие необходимо держать под контролем, чтобы бизнес работал без сбоев, как слаженный механизм, и автор подробно на примерах из практики рассказывает, как это сделать. Книга будет полезна как предпринимателям, так и любому менеджеру, работающему над оптимизацией процессов.</p>', 1, 7, '', '', '2021-03-03 10:24:04', '2021-03-03 10:24:04', 1, 4),
(15, 'Малобюджетный маркетинг', 'konstantin-sheremetev', 'Константин Шереметьев. Маркетинг - основа любого бизнеса. На каком бы уровне развития компании вы не находились: стартап, малое предприятие, корпорация.', '<p><strong>Программа курса</strong><br />\r\nНиже представлена полная программа курса: введение и 12 занятий в формате видео, а также текстовая версия и дополнительные материалы. Обратите внимание: там, где указана должность &laquo;маркетолог&raquo;, подразумевается или наёмный маркетолог, или владелец бизнеса, которые выполняет его задачи.<br />\r\n<br />\r\n<strong>Введение - О чём этот курс</strong><br />\r\n<br />\r\nЧто делать, если вначале были продажи, а потом поток заказов закончился<br />\r\nОшибки Константина, которые привели к двум банкротствам &mdash; ошибки, от которых он хочет вас уберечь<br />\r\nС вашим товаром всё хорошо, но желающих купить больше не становится? Кто виноват и что делать?<br />\r\n<br />\r\n<strong>Занятие 1 - Мифы и реальность маркетинга</strong><br />\r\n<br />\r\nСвязь маркетинга и продаж<br />\r\nПочему не работают советы по маркетингу из 90% книг?<br />\r\nПочему маркетинговые кейсы компании Coca-cola (а также Nike, Adidas и Mercedes-Benz) вам не помогут?<br />\r\nО чего зависит успех вашего бизнеса?<br />\r\nВо что нужно вкладывать деньги в бизнесе в первую очередь?<br />\r\nДва самых главные мифа о маркетинге<br />\r\n<br />\r\n<strong>Занятие 2 - Как устроен маркетинг</strong><br />\r\n<br />\r\nЧто такое настоящий маркетинг &mdash; определение маркетинга<br />\r\nКак делать эффективный маркетинг?<br />\r\nФормула четырёх П<br />\r\nКак выстроить стабильный поток заказов<br />\r\nКакие задачи у маркетолога?<br />\r\nЧто такое лид и лидогенерация?<br />\r\nЧто такое скоринг и почему его должен уметь делать каждый маркетолог?<br />\r\n<br />\r\n<strong>Занятие 3 - Маркетинговый бюджет</strong><br />\r\n<br />\r\nГлавный миф о сарафанном радио (и почему оно работает не так, как хотелось бы)<br />\r\nЧто такое воронка продаж?<br />\r\nКак оценить эффективность рекламного объявления?<br />\r\nЧто такое некачественные лиды?<br />\r\nЧто означает метрика CPL и почему её необходимо считать каждому маркетологу?<br />\r\nКакой бюджет необходимо выделять на маркетинг?<br />\r\nОшибка в расчете маркетингового бюджета, которая приводит к банкротству<br />\r\nКак не выбросить деньги на ветер при заказе рекламы?<br />\r\nМожно ли делать маркетинг без бюджета?<br />\r\nДва первых (бесплатных) шага, которые нужно сделать на старте бизнеса для получения первых заказов<br />\r\n<br />\r\n<strong>Занятие 4 - Понимание рынка</strong><br />\r\n<br />\r\nС чего начинается исследование рынка?<br />\r\nКак узнать свою целевую аудиторию?<br />\r\nГлавное, что вам необходимо знать о целевой аудитории<br />\r\nКак правильно анализировать конкурентов?<br />\r\nПочему нужно делать скоринг?<br />\r\nСкоринг по шагам<br />\r\n<br />\r\n<strong>Занятие 5 - Запуск лидогенерации</strong><br />\r\n<br />\r\nИз чего должна состоять ежедневная работа маркетолога?<br />\r\nСоздание лид-магнита<br />\r\nПлатный трафик<br />\r\nУчет и анализ рекламы<br />\r\nЧто такое &laquo;продажи в лоб&raquo; и почему они работают хуже, чем вы думаете?<br />\r\nВ чем ограничения бесплатных методов продвижения?<br />\r\nПочему вам важно научиться делать лендинги?<br />\r\n<br />\r\n<strong>Занятие 6 - Каналы лидогенерации</strong><br />\r\n<br />\r\nПочему одни каналы рекламы работают, а другие &mdash; нет?<br />\r\nКакой канал привлечения клиентов самый лучший?<br />\r\nЧто такое &laquo;реклама по площадям&raquo; и как она пожирает ваш маркетинговый бюджет?<br />\r\nТри самых эффективных канала привлечения потенциальных клиентов, которые вам нужно начать использовать прямо сейчас<br />\r\nЧто такое контент-маркетинг и почему его нужно использовать в любом бизнесе<br />\r\n<br />\r\n<strong>Занятие 7 - Системный подход к маркетингу</strong><br />\r\n<br />\r\nСистема, которую вы можете использовать в своём бизнесе и в работе по найму<br />\r\nПочему разовые акции работают не так, как хотелось бы<br />\r\nДва главных направления, в которых должен работать маркетолог<br />\r\nЧто такое деловой дневник и почему его стоит завести уже сегодня?<br />\r\nГлавная цель маркетинга<br />\r\n<br />\r\n<strong>Занятие 8 - Эффективная реклама</strong><br />\r\n<br />\r\nКак оценить эффективность рекламного объявления?<br />\r\nПочему разовые акции работают не так, как хотелось бы<br />\r\n3 правила создания качественной рекламы (с примерами)<br />\r\n<br />\r\n<strong>Занятие 9 - Работа с контактами</strong><br />\r\n<br />\r\nКак увеличить конверсию вашего предложения в разы?<br />\r\nВнешние и внутренние каналы рекламы<br />\r\nКак работать с собранными контактами: 3 лучших приёма привлечения клиентов с малым бюджетом<br />\r\n<br />\r\n<strong>Занятие 10 - Сплит-тестирование</strong><br />\r\n<br />\r\nКак грамотно работать с эффективностью рекламного объявления?<br />\r\nКак проверять свои гипотезы в маркетинге?<br />\r\nРазрешенные эксперименты, которые повышают продажи<br />\r\nПростой способ мониторинга конкурентов<br />\r\n<br />\r\n<strong>Занятие 11 - Контекстная реклама</strong><br />\r\n<br />\r\nЯндекс.Директ и Google.Реклама<br />\r\nИспользование таргетинга<br />\r\nЧто такое ремаркетинг?<br />\r\nВысокочастотные и низкочастотные запросы: как не просадить свой рекламный бюджет<br />\r\n<br />\r\n<strong>Занятие 12 - Окупаемость маркетинга</strong><br />\r\n<br />\r\nПочему необходимо подсчитывать возврат инвестиций от рекламы?<br />\r\nПрибыль или выручка<br />\r\nКакие ошибки допускают при подсчете окупаемости?</p>', 1, 2, '', '', '2021-03-03 10:24:52', '2021-03-03 17:49:30', 1, 5),
(16, 'Чек-листы \"Секреты онлайн бизнеса\"', 'aleksandra-gureeva', 'Александра Гуреева', '<p>Воспользовавшись ссылкой узнаете следующее:<br />\r\n<br />\r\n- 5 самых частых озражений и что с ними делать (схема)<br />\r\n- Шаблоны ответов на возражение &quot;Я ПОДУМАЮ&quot; + BONUS (чек -лист)<br />\r\n- Секреты постов, которые дочитывают до конца<br />\r\n&nbsp;</p>', 1, 7, '', '', '2021-03-03 10:34:18', '2021-03-03 10:58:37', 1, 5),
(17, 'Бизнес на Подушках-обнимашках', 'biznes-na-podushkah-obnimashkah', 'Как подушки-обнимашки превратить в икру с маслом и хорошую жизнь?', '<p><strong>Вы получили в свои руки материал с многократным запасом прочности.</strong><br />\r\n<br />\r\nЕсли вы будите упорно шаг за шагом следовать всем рекомендациям, Ваш успех просто неизбежен.<br />\r\n<br />\r\n<strong>В чем же выражается эта многократная прочность.</strong><br />\r\n<br />\r\nВсе дело в том, что данная работа не курс однодневка, а протестированная на протяжении более шести месяцев система.<br />\r\n<br />\r\nПриложите все усилия, чтобы Ваш результат был таким же.<br />\r\n<br />\r\nПродуктивного просмотра и до следующих Встреч!<br />\r\n<br />\r\n<strong>!!!Важно!!!</strong><br />\r\n<br />\r\nВидео-курс рассчитан на вашу самостоятельную работу.<br />\r\n<br />\r\nДля полного освоения материала потребуется время,<br />\r\n<br />\r\nваше серьезное, внимательное отношение к урокам<br />\r\n<br />\r\nи практика.<br />\r\n<br />\r\nНе торопитесь, и вы увидите плоды своего труда.<br />\r\n<br />\r\n<strong>В курсе представлены только личный опыт и мнение авторов.</strong><br />\r\nАвторы не несут ответственности за какие-либо убытки, прямые или косвенные,<br />\r\n<br />\r\nпонесенные в связи с вашей деятельностью после прохождения курса..<br />\r\n<br />\r\nВсе действия, предпринимаемые изучающим курс,<br />\r\n<br />\r\nсовершаются под его личную ответственность.<br />\r\n&nbsp;</p>', 1, 7, '', '', '2021-03-03 10:51:28', '2021-03-03 17:49:56', 1, 3),
(18, 'InstaСтратегия для малого бизнеса', 'instastrategiya-dlya-malogo-biznesa', 'Татьяна Кидимова - как выстроить стратегию продаж и научится создавать эффективный контент-план для инстаграм', '<p><strong>Курс подходит вам, если Вы:</strong></p>\r\n\r\n<ul>\r\n	<li>Продаете товары или услуги через Инста-магазин.</li>\r\n	<li>Занимаетесь консалтингом, частной практикой, фрилансом или handmade и ХОТИТЕ продавать в Инстаграм.</li>\r\n	<li>Ведете экспертный блог, но никак не можете продать свои инфопродукты или не достигаете поставленных целей.</li>\r\n	<li>Планируете открыть бизнес, уже решили какой (есть продукт, понимание рынка и бизнес-модели) и хотите сразу &quot;нормально&quot; начать продавать на ИнстаПлощадке.</li>\r\n</ul>\r\n\r\n<p><strong>Вас ждет&nbsp;</strong>4 видеоурока на обучающей платформе.<br />\r\n<br />\r\n<strong>Темы уроков:</strong><br />\r\n- Зачем вам Instagram?<br />\r\n- Контент-Стратегия в Instagram;<br />\r\n- Стратегия продвижения в Instagram;<br />\r\n- Стратегия продаж в Instagram.<br />\r\n<br />\r\n<strong>Кроме видеоуроков, домашних заданий, вы получаете:</strong></p>\r\n\r\n<ul>\r\n	<li>рабочую тетрадь для выполнения заданий;</li>\r\n	<li>подробную презентацию-конспект курса (суммарно 90 слайдов со схемами и тезисами);</li>\r\n	<li>шаблоны таблиц с АВТОМАТИЧЕСКИ настроенными формулами, остается только подставить свои цифры</li>\r\n	<li>шаблоны таблиц для аудита контента и гибкого контент-плана;</li>\r\n	<li>чек-лист &quot;правильного&quot; аккаунта в Instagram;</li>\r\n	<li>69 идей для постов инстаграм, которые ведут к покупке;</li>\r\n	<li>30 небанальных вариантов продающих постов, чтобы &quot;продавать, не продавая&quot;.</li>\r\n</ul>\r\n\r\n<p><strong>Инвестиции в обучение окупятся в десятки раз:</strong><br />\r\n+ 20% к выручке за счет правильного контент-плана и выстроенной стратегии продаж в Инстаграм, а не размещения &quot;постиков&quot;.<br />\r\n+ 17% клиентов - именно столько клиентов вы теряете, когда не соблюдаете элементарных правил продаж в Инстаграм (шапка, контент, витрина, тексты, ссылка в профиле).<br />\r\n+ 40% к прибыли за счет замены неэффективных вариантов продвижения в Инстаграме на стратегически важные для вашего бизнеса.</p>', 1, 6, '', '', '2021-03-03 13:18:18', '2021-03-03 13:18:18', 1, 5),
(19, 'Как открыть кофейню', 'kak-otkryt-kofeynyu', 'Александр Воеводин – помочь основателям собственных кофеен, мини-кофеен, кофе-магазинов, чайных, магазинов по продаже чая и кофе.', '<p>Книга полезна и тем, кто еще не решился открыть свое дело, но не хочет оставаться рядовым сотрудником. Изложенная здесь информация поможет взглянуть на многие рабочие моменты сферы HoReCa с точки зрения владельца. Применение моего опыта и советов, изложенных в этой книге, однозначно принесет пользу компании и поможет продвигаться выше и выше по карьерной лестнице.<br />\r\n<br />\r\nЭта книга написана на основе моего личного опыта и опыта тех кофеен, ресторанов, клубов и других заведений сегмента HoReCa (отелей, ресторанов, кафе, кофеен и т.д.), в которых мне довелось лично побывать и с которыми посчастливилось сотрудничать.</p>', 1, 7, '', '', '2021-03-03 14:06:12', '2021-03-03 14:06:12', 1, 4),
(20, 'Чек-лист 10+ идей для бизнеса', 'chek-list-10-idey-dlya-biznesa', 'Елена Старецкая - в кризис можно и нужно создавать предприятия!', '<p>Во времена санкций, ограничений и кризиса работают совершенно другие процессы, которые не работают в обычном режиме економики. Мой список 10+ идей, которые помогут выйти на новый уровень доходов благодаря кризису!</p>', 1, 7, '', '', '2021-03-03 16:08:18', '2021-03-03 17:44:30', 1, 3),
(21, 'Предметная съемка и ее детали', 'predmetnaya-semka-i-ee-detali', 'Как фотографировать работы, чтобы их покупали: фирменный мастер-класс по предметной съемке от компании Nikon и полезные советы опытных мастеров', '<p>Всё о ракурсах и&nbsp;о&nbsp;композиции, об освещении: баланс белого, лайтбоксы, отражатели и рассеиватели. Полное описание как показать детали: о глубине резкости, экспозиции, диафрагме. Немного об аксесуарах и о работе со штативом.&nbsp;</p>', 1, 1, '', '', '2021-03-03 17:33:20', '2021-03-03 17:33:20', 1, 3),
(22, 'Эффективность', 'effektivnost', 'Маргулан Сейсембаев - мой авторский курс «Эффективность» построен исключительно на личном опыте и результатах. На курсе подробно разберемся с сущностью эффективности и ее взаимосвязью с мирозданием.', '<p><strong>Программа курса:</strong><br />\r\n<br />\r\nУрок 1 Основной инструмент эффективности<br />\r\nЧто построено на законах эффективности? Какой основной инструмент эффективности?<br />\r\n<br />\r\nУрок 2 Принципы распределения благ<br />\r\nПочему доходы между людьми разнятся в десятки, сотни и даже в тысячи раз?<br />\r\n<br />\r\nУрок 3 Мироздание и эффективность<br />\r\nИз каких систем состоит мир? Какая сила создает хаос, а какая его упорядочивает и структурирует?<br />\r\n<br />\r\nУрок 4 Основные характеристики эффективности<br />\r\nИз каких компонентов состоит эффективность?<br />\r\n<br />\r\nУрок 5 Условия эффективности<br />\r\nБез чего эффективность невозможна?<br />\r\n<br />\r\nУрок 6 Признаки эффективности<br />\r\nВ этом уроке подробно разбираемся с 41 признаком эффективности.<br />\r\n<br />\r\nУрок 7 Правила эффективности<br />\r\nРазбираемся с базовыми и дополнительными правилами эффективности.<br />\r\n<br />\r\nУрок 8 Эффективность и эффективный процесс<br />\r\nПодводим итог и определяем практическую ценность эффективности.</p>', 1, 7, '', '', '2021-03-03 18:42:21', '2021-03-03 18:42:21', 1, 5),
(23, 'Бизнес с Китаем', 'biznes-s-kitaem', 'Алина Рязанова - подробная пошаговая программа, как открыть свой товарный бизнес с нуля за 2 месяца не выходя из дома!', '<p><strong>КОМУ ПОДОЙДЕТ ЭТОТ КУРС:</strong><br />\r\n- Начинающим предпринимателям, которые планируют запустить бизнес в короткий срок<br />\r\n- Тем, кто работает в найме, и хочет совмещать основную работу со стартом своего бизнеса<br />\r\n- Действующим предпринимателям, которые ищут товар для продажи с хорошей маржой<br />\r\n- Мамам в декрете, которые хотят начать свое дело и уделять ему минимум времени<br />\r\n<br />\r\n<br />\r\n<strong>Программа обучения<br />\r\n<br />\r\n1 УРОК</strong><br />\r\nПоиск и выбор товара.<br />\r\nВыбор ниши, анализ рынка и конкурентов</p>\r\n\r\n<ul>\r\n	<li>Выбор ниши</li>\r\n	<li>Критерии при выборе товара для высоких продаж</li>\r\n	<li>Тестирование ниши</li>\r\n	<li>Анализ рынка и конкурентов</li>\r\n	<li>Что такое целевая аудитория? Анализ целевой аудитории</li>\r\n	<li>Разработка стратегии по выходу вашего продукта на рынок</li>\r\n</ul>\r\n\r\n<p>Бонусы к уроку:<br />\r\n&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Шаблон-таблица для выбора ниши</li>\r\n	<li>Шаблон-таблица для конкурентного анализа</li>\r\n	<li>Список актуальных и трендовых ниш в 2021 году</li>\r\n	<li>Таблица для анализа целевой аудитории</li>\r\n</ol>\r\n\r\n<p>Результат модуля: Найдете конкурентоспособный товар, пользующийся спросом. Определите свою целевую аудиторию. Сделаете тест ниши и разработаете стратегию по выходу продукта на рынок.<br />\r\n<br />\r\n<strong>2 УРОК</strong><br />\r\nПокупка товара в Китае</p>\r\n\r\n<ul>\r\n	<li>Как искать и выбирать товар: участие в выставках и удаленные способы поиска товара.</li>\r\n	<li>Обзор площадок для онлайн-закупок: Таобао, 1688, Алибаба.</li>\r\n	<li>Сравнение площадок для покупок в Китае, выбор оптимальной площадки под ваши задачи.</li>\r\n	<li>Важные нюансы при оптовых покупках</li>\r\n	<li>Какие вопросы задать поставщику перед началом сотрудничества?</li>\r\n	<li>Заказ образцов продукции</li>\r\n	<li>Выставки в Китае.</li>\r\n</ul>\r\n\r\n<p>Бонусы к уроку:</p>\r\n\r\n<ol>\r\n	<li>Видеоуроки по работе с китайскими сайтам Таобао, Тмалл, 1688, Алибаба.</li>\r\n	<li>Шаблон-таблица для сравнения и выбора поставщиков</li>\r\n	<li>База поставщиков</li>\r\n	<li>Русско-китайский разговорник для общения с китайскими продавцами</li>\r\n</ol>\r\n\r\n<p>Результат модуля: Научитесь искать товар на 3 онлайн-площадках Китая и офлайн выставках. Подберете площадку с подходящим для вас товаром. Узнаете, как выбрать поставщика.<br />\r\n<br />\r\n<strong>3 УРОК</strong><br />\r\nВвоз товара из Китая</p>\r\n\r\n<ul>\r\n	<li>Схемы ввоза товаров из Китая</li>\r\n	<li>Посредники и таможенные брокеры</li>\r\n	<li>Выбор посредника/логиста. Какие вопросы задать посреднику перед началом сотрудничества?</li>\r\n	<li>Схема выкупа товара</li>\r\n	<li>Просчёт стоимости логистики, плотность груза</li>\r\n</ul>\r\n\r\n<p>Бонусы:<br />\r\n<br />\r\n1. Пошаговая инструкция: как работать с логистическими компаниями?<br />\r\n2. Список посредников и логистических компаний для работы<br />\r\n3. Инструкция по расчету стоимости логистики поставки.<br />\r\n4. Шаблон-таблица для выбора посредника/логиста.<br />\r\n<br />\r\nРезультат модуля: Разберетесь в схемах ввоза товара из Китая и выберите подходящую для вашего товара. Выберите посредника по логистике и сделаете предварительный просчет стоимости доставки товара.<br />\r\n<br />\r\n<strong>4 УРОК</strong><br />\r\nПодготовка к продажам</p>\r\n\r\n<ul>\r\n	<li>Бухгалтерские вопросы бизнеса</li>\r\n	<li>Юридические вопросы, сертификация и маркировка товара.</li>\r\n	<li>Когда нужен товарный знак?</li>\r\n	<li>Расчет ценообразования.</li>\r\n</ul>\r\n\r\n<p>Бонусы:<br />\r\n<br />\r\n1. Список сертификационных центров.<br />\r\n2. Схема регистрации товарного знака.<br />\r\n3. Краткий справочник по сравнению систем налогообложения.<br />\r\n4. Шаблон-таблица для расчета ценообразования продукта.<br />\r\n<br />\r\nРезультат: Разберетесь в бухгалтерских и юридических вопросах на старте бизнеса. Узнаете, нужна ли для вашего товара маркировка и сертификация. Рассчитаете ценообразование вашего продукта.<br />\r\n<br />\r\n<strong>5 УРОК</strong><br />\r\nРеализация товара. Способы заработка: от совместных покупок до выхода на маркетплейсы</p>\r\n\r\n<ul>\r\n	<li>Продажи через Инстаграм и другие соцсети: создание и оформление аккаунта, таргетированная реклама, продвижение через блогеров.</li>\r\n	<li>Продажи с минимальными вложениями: совместные покупки, Авито и доски объявлений.</li>\r\n	<li>Маркетплейсы. Пошаговая схема выхода на Wildberries, Ozon, Беру, Алиэкспресс. Сравнение плюсов и минусов популярных маркетплейсов.</li>\r\n	<li>Продажи через свой интернет-магазин.</li>\r\n</ul>\r\n\r\n<p>Бонусы:<br />\r\n<br />\r\n1. Гайд по таргетированной рекламе в Инстаграм и Фейсбук<br />\r\n2. Список полезных приложений для продвижения в социальных сетях.<br />\r\n3. Методическое пособие по работе с порталом поставщиков WB<br />\r\n<br />\r\nРезультат: Узнаете, как продавать товары через маркетплейсы. Создадите свой интернет-магазин и запустите продажи на страницах бренда в социальных сетях. Освоите способы реализации товара с минимальными вложениями: через доски объявлений и совместные покупки.</p>', 1, 7, '', '', '2021-03-03 19:17:58', '2021-03-03 19:17:58', 1, 5),
(24, 'Быстрые деньги в образовательном бизнесе', 'bystrye-dengi-v-obrazovatelnom-biznese', 'Юрий Курилов - как вы смотрите на то, чтобы за короткий срок узнать множества стратегий дохода на образовательных услугах.', '<p><strong>Приходите на интенсив, чтобы узнать:</strong><br />\r\n<br />\r\n+ Что можно сделать, если у вас пока вообще ничего нет: ни базы, ни денег<br />\r\n+ Как можно сделать больше денег, вложив небольшую сумму денег<br />\r\n+ Тактики дополнительного дохода от своей базы<br />\r\n+ Как сделать так, чтобы о вас, как о продюсере, узнали эксперты, прониклись к вам доверием и захотели с вами работать<br />\r\n+ Как мой клиент с доходом 300 тыс. сделал дополнительных 700 тыс. за несколько недель, воспользовавшись несколькими советами, и что это были за совет</p>', 1, 7, '', '', '2021-03-03 19:19:02', '2021-03-03 19:25:17', 1, 3),
(25, 'Система эффективного бизнеса', 'sistema-effektivnogo-biznesa', 'Александр Высоцкий - узнайте, как попасть в лигу сильнейших собственников компаний и выйти из кризиса победителем', '<p><strong>ПРОГРАММА ТРЕНИНГА<br />\r\n<br />\r\nДЕНЬ 1. ЭВОЛЮЦИЯ ВЛАДЕЛЬЦА БИЗНЕСА</strong><br />\r\nВ результате прохождения 1-го дня тренинга вы узнаете:<br />\r\nпуть эволюции, который проходит владелец, начиная с зарождения идеи бизнеса и заканчивая построенной корпорацией;<br />\r\nкак изменяются роль владельца и его работа в зависимости от того, на какой стадии развития находится бизнес (это даст чёткое понимание того, что ждёт владельца на последующих этапах развития бизнеса);<br />\r\nкак предусмотреть и как избежать проблем в партнёрстве &mdash; одну из самых больших ловушек, подстерегающих владельцев (это знание сэкономит и высвободит для владельца очень много времени, позволив направить его на развитие компании).<br />\r\n<br />\r\n<strong>ДЕНЬ 2. ОРГСХЕМА, СИСТЕМА БЫСТРОГО ПОТОКА, НАЙМ И СКОРОСТЬ РОСТА</strong><br />\r\nВ результате прохождения 2-го дня тренинга вы узнаете:<br />\r\nроль оргструктуры: какова её взаимосвязь с эффективностью, с производительностью каждого подразделения и каждого отдельного сотрудника;<br />\r\nкакой должна быть оргструктура, соответствующая бизнес-процессам именно в вашей компании;<br />\r\nкакие подразделения в компании должны быть, как они взаимосвязаны между собой, какие функции у каждого из подразделений и кому они должны подчиняться;<br />\r\nкак выглядят очень успешные шаблоны, которые применяют самые успешные корпорации в оргструктуре своих компаний;<br />\r\nкак ускорить найм и введение в должность сотрудника.<br />\r\n<br />\r\n<strong>ДЕНЬ 3. СИСТЕМА ИЗМЕРЕНИЯ РЕЗУЛЬТАТОВ, ИЦО И ЕГО АНАЛИЗ</strong><br />\r\nВ результате прохождения 3-го дня тренинга вы узнаете:<br />\r\nкакой должна быть одна из важнейших частей системы управления &mdash; система измерения результатов: как она выглядит, как должна работать и как правильно её использовать;<br />\r\nкак измерять результаты работы сотрудника;<br />\r\nкак распознать, успешен ли план работы сотрудника;<br />\r\nкак точно отслеживать эффективное время, затрачиваемое сотрудником на работу, и как отслеживать улучшение или ухудшение результатов этой работы;<br />\r\nна какие признаки ориентироваться при поощрении или наказании сотрудников;<br />\r\nчто такое &laquo;Информационный Центр Организации&raquo; и как использовать этот инструмент для анализа руководителей и их дальнейшего роста.<br />\r\n<br />\r\n<strong>ДЕНЬ 4. ПЛАНИРОВАНИЕ И КООРДИНАЦИЯ</strong><br />\r\nВ результате прохождения 4-го дня тренинга вы узнаете:<br />\r\nкак сделать так, чтобы работа каждого сотрудника и каждого руководителя была осознанной;<br />\r\nчто нужно сделать, для того чтобы сотрудники самостоятельно планировали свою деятельность и старались добиваться максимальных результатов;<br />\r\nкакой должна быть система планирования, при которой сотрудники всех уровней выкладываются по максимуму, а руководители при этом тратят минимальные усилия;<br />\r\nкакие инструменты нужны для эффективного планирования и как правильно их применять.<br />\r\n<br />\r\n<strong>ДЕНЬ 5. УПРАВЛЕНИЕ ФИНАНСАМИ</strong><br />\r\nВ результате прохождения 5-го дня тренинга вы узнаете:<br />\r\nкакие самые распространённые ошибки допускают 99,9% владельцев в управлении финансами, которые впоследствии приводят к тому, что владельцы несут на себе всю ответственность и не получают свои дивиденды регулярно;<br />\r\nкак по-настоящему должна работать система управления финансами;<br />\r\nчто нужно сделать и какой инструмент использовать, для того чтобы прежде всего руководители взяли на себя полную ответственность за финансы компании и боролись за то, чтобы доход компании рос с каждым месяцем.<br />\r\n<br />\r\n<strong>ДЕНЬ 6. КАК ВНЕДРЯТЬ ИЗМЕНЕНИЯ</strong><br />\r\nВ результате прохождения 6-го дня тренинга вы узнаете:<br />\r\nкакие ошибки совершают владельцы бизнеса при попытках самостоятельно построить систему управления и как их избежать;<br />\r\nкак при попытке построения системы в своём бизнесе не разрушить уже успешно работающие процессы в компании и не потерять при этом ценных сотрудников;<br />\r\nкакова взаимосвязь инструментов управления и как правильно собрать их в единую систему;<br />\r\nкак и в какой последовательности необходимо строить эту систему.</p>', 1, 7, '', '', '2021-03-03 19:48:09', '2021-03-03 19:48:09', 1, 3),
(26, 'Чек-лист SMM-менеджера', 'chek-list-smm-menedzhera', 'SMM – это универсальный инструмент, которым могут пользоваться компании любого размера и направления. Все, что нужно для работы – страницы или группы в социальных сетях.', '<p>Реклама в социальных сетях (SMM) &ndash; это тип интернет-маркетинга, при помощи которого компании (блогеры, сайты, фирмы, бренды и т.д.) взаимодействуют с потенциальными клиентами. Аббревиатура SMM расшифровывается как Social Media Marketing &ndash; маркетинг в социальных сетях.<br />\r\n<br />\r\nВ рамках SMM продвижения решается, какой контент и когда публиковать, как отвечать на комментарии и отзывы, как побуждать людей оставлять комментарии и отзывы, какие приемы для поднятия активности использовать и многое другое.<br />\r\n<br />\r\nДля чего нужно SMM-продвижение? Его используют для того, чтобы повысить узнаваемость бренда, расширить аудиторию, привлечь новых подписчиков и покупателей, повысить популярность или количество продаж, лояльность аудитории.</p>', 1, 4, '', '', '2021-03-04 13:19:24', '2021-03-04 13:19:24', 1, 3),
(27, 'SMM PACK', 'smm-pack', 'Анна Белова - уже готовый шаблон контент-плана\r\n+100 идей для постов', '<p>Шаблон отчета для клиента<br />\r\n<br />\r\nШаблон стратегии продвижения<br />\r\n<br />\r\nИнструкция по анализу конкурентов<br />\r\n<br />\r\nИнструкция по анализу ЦА<br />\r\n<br />\r\nПримеры вопросов для брифа<br />\r\n<br />\r\nШаблон аудита аккаунта клиента<br />\r\n<br />\r\nШаблон коммерческого предложения<br />\r\n<br />\r\nОтработка самых частых возражений клиентов<br />\r\n<br />\r\nСловарь smm-специалиста<br />\r\n<br />\r\nПример продающего резюме smm-специалиста<br />\r\n<br />\r\nЧто почитать? 100+ полезных ресурсов</p>', 1, 4, '', '', '2021-03-04 15:00:00', '2021-03-04 15:00:00', 1, 4),
(28, 'TikTok наизнанку', 'tiktok-naiznanku', 'Практика показала, что в такой соцсети как TikTok можно самостоятельно продвигаться без всяких проблем и достичь успеха.', '<p><strong>Самое трудное - это начать!<br />\r\nВозникает можество вопросов и страхов:<br />\r\n&nbsp;- Как?</strong><br />\r\n<strong>&nbsp;- С чего?</strong><br />\r\n<br />\r\nЕсли у тебя есть аккаунт, который ты ведешь, но он стоит на месте - эти курсы расскажут каку обернуть все в лучшую сторону и вывести твой аккаунт&nbsp;TikTok в топы!</p>', 1, 4, '', '', '2021-03-04 15:50:17', '2021-03-04 15:50:17', 1, 5),
(29, 'Таргет для бьюти мастеров', 'target-dlya-byuti-masterov', 'Анна Завацкая - вы получите: методичку \"Таргет для бьюти мастеров\". Что внутри - 78 страниц контента «без воды» с примерами\r\n+Бонусы', '<p><strong>Эта методичка подходит для вас, если вы:</strong></p>\r\n\r\n<ul>\r\n	<li>Хотите привлечь новых клиентов и подписчиков</li>\r\n	<li>Уже настраивали таргетированную рекламу, но лишь слили деньги и не получили нужного результата. Хотите понять ошибки и исправить их</li>\r\n	<li>Работаете в бьюти-сфере. Инструкции и примеры в методичке приведены для бьюти-специалистов</li>\r\n</ul>\r\n\r\n<p><strong>В результате Вы:</strong><br />\r\nСможете привлечь новых клиентов и подписчиков с помощью таргетированной рекламы уже через пару часов<br />\r\n<br />\r\n<strong>Содержание:</strong></p>\r\n\r\n<ol>\r\n	<li>Вводная часть</li>\r\n	<li>Теоретическая часть. Справочник. Настройки</li>\r\n	<li>Креативы. Чем привлечь клиента. Как сделать &quot;рабочий&quot; креатив</li>\r\n	<li>Запуск рекламы через приложение Инстаграм. Кнопка &laquo;Продвигать&raquo; под постом</li>\r\n	<li>Размещение рекламы через приложение Фейсбук</li>\r\n	<li>Аудитории и интересы</li>\r\n	<li>Тестирование и масштабирование рекламной кампании</li>\r\n	<li>Как смотреть рекламу конкурентов в Инстаграм?</li>\r\n	<li>Техподдержка по рекламе</li>\r\n</ol>', 1, 4, '', '', '2021-03-04 15:59:30', '2021-03-04 16:29:41', 1, 4),
(30, 'Как поднять охваты не банальными способами', 'kak-podnyat-ohvaty-ne-banalnymi-sposobami', '10+ идей не банальных способов поднять охват', '<p>Если задался целью, но не понимаешь, что делать дальше... Ведь чтобы не делал - стоишь на месте? Тогда этот чек-лист для тебя!</p>', 1, 6, '', '', '2021-03-04 16:06:42', '2021-03-04 16:06:42', 1, 3),
(31, 'Инструкция по созданию Taplink', 'instrukciya-po-sozdaniyu-taplink', 'Taplink.ru – это инструмент, с помощью которого можно создать визитку-сайт для Инстаграм аккаунта, а также продвигать этот сайт в рекламе.', '<p><strong>Этот инструмент позволяет:</strong><br />\r\n1. Разместить все нужные ссылки в одном месте;<br />\r\n2. Создать мини-сайт для продвижения услуги или товара;<br />\r\n3. Принимать оплаты и заказы онлайн;<br />\r\n4. Отслеживать статистику переходов, заявок, заказов.</p>', 1, 6, '', '', '2021-03-04 16:10:20', '2021-03-04 16:10:20', 1, 4),
(32, 'Таргетинг в Facebook/Instagram для начинающих', 'targeting-v-facebook-instagram-dlya-nachinayushchih', 'Григорий Кузин - благодаря курсу ты узнаешь, как создавать эффективную таргетированную рекламу', '<p><strong>Программа курса:</strong><br />\r\n<br />\r\n7 уроков и 7 практических заданий<br />\r\n<strong>Урок 1.&nbsp;</strong>Шапка профиля в Instagram.<br />\r\n<strong>Урок 2.&nbsp;</strong>Виды контента в Instagram.<br />\r\n<strong>Урок 3.&nbsp;</strong>Создание рекламного кабинета в Facebook.<br />\r\n<strong>Урок 4.&nbsp;</strong>Креативы и ЦА.<br />\r\n<strong>Урок 5.&nbsp;</strong>Запуск, масштабирование и оптимизация.<br />\r\n<strong>Урок 6.&nbsp;</strong>Подготовка портфолио.<br />\r\n<strong>Урок 7.&nbsp;</strong>Где искать клиентов.</p>', 1, 6, '', '', '2021-03-04 16:21:46', '2021-03-04 16:21:46', 1, 5),
