(37, 'Основы нейротаргета', 'osnovy-neyrotargeta', 'О сложном простыми словами', '<p>Лимбическая рекогниция, или другими словами - узнавание образа. Инструмент который широко используется для создавания креативов на аудиторию онкурентов. Советов не будет, лишь конструктив, благодаря которому вы станете проффесионалами.&nbsp;</p>', 1, 2, '', '', '2021-03-04 19:28:10', '2021-03-04 19:28:10', 1, 5),
