(40, 'Как взлететь в YouTube и Instagram', 'kak-vzletet-v-youtube-i-instagram', 'Бесценные рекомендации проверенные людьми и временем', '<p>Я раскажу:<br />\r\n&bull; Как выбрать интересную тему для блога<br />\r\n&bull; Как набрать первые 5000 подписчиков<br />\r\n&bull; Возможности заработка в YOUTUBE и INSTAGRAM<br />\r\n&bull; Секреты продвижения<br />\r\n&bull; Создание структуры и сценария роликов<br />\r\n&bull; Как грамотно оформить канал<br />\r\n&bull; Необходимое оборудование и программы<br />\r\n&bull; Как снимать фото и видео<br />\r\n&bull; Как правильно монтировать и обрабатывать видео<br />\r\n&bull; Как не бояться быть в кадре, приемы и секреты</p>', 1, 6, '', '', '2021-03-04 19:47:55', '2021-03-04 19:47:55', 1, 3),
(41, 'Stories instagram. Продавай не продавая', 'stories-instagram-prodavay-ne-prodavaya', 'Анастасия Лушникова, всё, что нужно знать - в одном гайде', '<p>Программа гайда:<br />\r\n- Что такое Stories?<br />\r\n- Тепловая карта Instagram.<br />\r\n- Эволюция продаж в Instagram.<br />\r\n- Как пользователь принимает решение о покупке?<br />\r\n- Как провести анализ целевой аудитории?<br />\r\n- Как задавать вопросы, чтобы получать правильные ответы?<br />\r\n- Какие сервисы использовать для проведения опросов?<br />\r\n- Как выявить истинные потребности клиентов?<br />\r\n- Что такое пирамида Маслоу и как формировать продукты, в которых нуждается ваша аудитория?<br />\r\n- Ментальные триггеры и как они влияют на принятие решения.<br />\r\n- Правила оформления Stories.<br />\r\n- Пошаговая схема запуска в Stories и секрет, о котором все молчат.<br />\r\n- Как сделать запуск совместно с аудиторией?</p>', 1, 6, '', '', '2021-03-04 20:22:46', '2021-03-04 20:22:46', 1, 3),
(42, 'Революции в маркетинге', 'revolyucii-v-marketinge', 'Владимир Сургай - помогу разобрать схему из 3-5 LP и вы поймете, что впереди еще огромный запас по эффективности в 95% бизнесов', '<p>&nbsp;Я вкратце пробегусь и отвечу на ваши вопросы по программе<br />\r\n- Детально разберу 8 шагов + подводные камни и какие конкретно нужно делать действия для постепенного перехода к 10000$ для маркетологов и предпринимателей<br />\r\n- Поделюсь двумя американскими фишками<br />\r\n- Роман Берман расскажет про свою находку КВИЗБОТЫ + умный таргет: как делать горячие лиды за 60 руб почти без вложений в разработку<br />\r\n- Дам секретные бонусы участникам вип-дня<br />\r\n- Поотвечаю на вопросы, которые вы прислали к нам в сообщения сообщества<br />\r\n- И отвечу уже в прямом эфире, если вы не успели до 11:00, сделаю персональные разборы</p>', 1, 2, '', '', '2021-03-04 20:49:52', '2021-03-04 20:49:52', 1, 4),
(43, 'Закрытый стратегический мастер-класс «МАРКЕТИНГ-2021»', 'zakrytyy-strategicheskiy-master-klass-marketing-2021', 'Наталья Баршева - новый мастер-класс для владельцев, директоров и ТОП-менеджеров компаний', '<p>Современный маркетинг &ndash; это управление выбором потребителя. Чтобы покупатель мог сделать нужный вам выбор, необходим Бренд, как гарант доверия, и эффективные коммуникации. О том, как строить такую работу и на что опираться, поговорим на новом мастер-классе.</p>\r\n\r\n<p>Темы мастер-класса:<br />\r\n- Главное СЛОВО и главный НАВЫК руководителя в 2021 году<br />\r\n- 4 МЕГАТРЕНДА современного маркетинга, которые должны определять бизнес-процессы успешной компании.<br />\r\n- Как работать с трендами, чтобы они превращались в ДЕНЬГИ, и где искать новые ИДЕИ для развития?<br />\r\n- Направления маркетинговой работы-2021<br />\r\n&nbsp;</p>', 1, 2, '', '', '2021-03-04 20:56:13', '2021-03-04 20:56:13', 1, 5),
(44, 'Таргет без воды', 'target-bez-vody', 'Григорий Бирюков - в  этом курсе вы найдёте ответы на все вопросы касающегося таргета', '<p>Узнайте как:</p>\r\n\r\n<p>- создавать 3D-аудитории по авторской методике, чтобы не сливать бюджет впустую?<br />\r\n- создавать скрипты по авторской методике, чтобы увеличивать количество продаж?<br />\r\n- создавать квизы с высокой конверсией, чтобы увеличивать количество заявок в 3 раза?<br />\r\n- проводить результативное тестирование, чтобы уже на этапе теста получать первые заявки и продажи?<br />\r\n- находить платежеспособную аудиторию для любого бизнеса, чтобы получать максимально горячие заявки?<br />\r\n- правильно выбирать цели для рекламной кампании, чтобы получать максимальный результат по низкой стоимости?<br />\r\n- экономить 20% на оплате рекламы?<br />\r\n- писать продающие офферы?<br />\r\n- результативно продвигать Instagram-профиль, чтобы увеличивать охваты?</p>', 1, 4, '', '', '2021-03-04 22:05:26', '2021-03-04 22:35:34', 1, 4),
(45, 'Системный навык поискового продвижения сайтов', 'sistemnyy-navyk-poiskovogo-prodvizheniya-lyubyh-saytov-2020', 'Дмитрий Шахов - неоднократно проверено мною на практике и гарантированно даёт результат.', '<p>Программа курса:<br />\r\n- Стратегии поискового продвижения<br />\r\n- Аудит сайта и исправление ошибок<br />\r\n- Работа с семантикой или видение ниши глазами пользователей<br />\r\n- Внутренняя оптимизация отдельных страниц<br />\r\n- Работа с поведенческими и коммерческими факторами<br />\r\n- Внешнее продвижение ссылками<br />\r\n- Внешнее продвижение социальными сигналами и ПФ<br />\r\n- Обсуждение проектов, что делать дальше</p>', 1, 2, '', '', '2021-03-04 22:31:17', '2021-03-04 22:34:55', 1, 4),
(46, '165 фишек и 33 основы реальный маркетинг', '165-fishek-i-33-osnovy-realnyy-marketing', 'Никита Жестков - \"Фишечная стратегия\", проще говоря - это стратегия, которая состоит из фишек.', '<p><strong>Методичка состоит из 6-ти разделов:</strong><br />\r\n- План развития маркетинга;<br />\r\n- Отличия от конкурентов;<br />\r\n- Привлечение клиентов;<br />\r\n- Продажи через маркетинг;<br />\r\n- Отношения и возврат;<br />\r\n- Максимизация прибыли.<br />\r\n<br />\r\nФактически в ней выжимка из сотен тренингов и книг по маркетингу и продажам. А также самый сок и концентрат успешных действий моих небольших клиентов (на уровне одной торговой точки) и крупных игроков (включая представителей Sony, Автоваз и так далее).<br />\r\n<br />\r\n<strong>КРАТКАЯ ИНФОРМАЦИЯ</strong><br />\r\nФормат: текст + картинки;<br />\r\nОбъём: 121 страница;<br />\r\nСпособов: 198 штук;<br />\r\nВерсия: PDF (онлайн)<br />\r\nПодходит: личному бренду, стартапам, небольшим и средним компаниям.</p>', 1, 2, '', '', '2021-03-05 10:05:09', '2021-03-05 10:05:09', 1, 4),
(47, 'Рабочая тетрадь-конструктор «Cобери свой продающий текст за 5 минут»', 'rabochaya-tetrad-konstruktor-soberi-svoy-prodayushchiy-tekst-za-5', 'Чтобы работать в интернете из дома, нужно для начала что-то уметь делать лучше, чем другие', '<p>Содержание:</p>\r\n\r\n<p>- Заголовок, который превликает внимани<br />\r\n- Что такое лид-абзац и зачем он нужен<br />\r\n- Офер и принцип его работы<br />\r\n- Проддажа выгоды или выявление потребности<br />\r\n- Почему цена имеет значение<br />\r\n- Зачем нужны: &quot;только сейчас&quot; и &quot;ограниченое количество&quot;<br />\r\n- Как направить аудиторию к покупке вашего продукта</p>', 1, 5, '', '', '2021-03-05 10:35:55', '2021-03-11 07:04:25', 1, 1),
(48, 'Гибкие продажи как продавать в эпоху перемен', 'gibkie-prodazhi-kak-prodavat-v-epohu-peremen', 'Джил Конрат - чтобы успевать за меняющимся миром бизнеса, нужно быть очень проворным продавцом', '<p>Эта книга поможет вам:</p>\r\n\r\n<ul>\r\n	<li>точно определить ключевые для вашей работы навыки и информацию;</li>\r\n	<li>выделить самые эффективные методики продаж;</li>\r\n	<li>найти свежие решения проблем, ограничивающих ваше развитие в сфере продаж;</li>\r\n	<li>стать гораздо продуктивнее.</li>\r\n</ul>\r\n\r\n<p>Результат? Если вы продавец - вы станете настоящим экспертом, способным решить любую новую проблему и разобраться с новыми рынками, товарами, клиентами. Если вы руководитель - ваша команда станет работать продуктивнее и добиваться лучших показателей продаж.<br />\r\n<br />\r\nДля кого эта книга<br />\r\nЭто книга для продавцов, консультантов, специалистов по продажам, которые хотят стать эффективнее.<br />\r\nИ для руководителей отделов продаж, которые заинтересованы в развитии своей команды.</p>', 1, 3, '', '', '2021-03-05 10:54:00', '2021-03-05 10:54:00', 1, 5);
INSERT INTO `draws` (`id`, `title`, `prize`, `end_date`, `link`, `image`, `is_active`, `is_free`, `created_at`, `updated_at`, `is_person`, `slug`, `extras`, `is_land`, `land_theme`, `land_sub`, `land_image`, `land_text`, `land_insta`, `land_count`, `land_image2`, `land_image3`) VALUES
(1, 'Акция Garnier: «Пробуди природу своей красоты»', 'Инновационный фен', '2021-03-08 21:00:00', 'https://ilove.garnier.ru/promo/mk', 'uploads/j6uq870h.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:44:34', '2021-03-05 18:50:49', 0, 'akciya-garnier-probudi-prirodu-svoey-krasoty', '<p>Пробуди природу своей красоты вместе с Garnier и &laquo;Магнит Косметик&raquo;.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Еженедельные призы - Сертификаты &laquo;Магнит косметик&raquo; номиналом 500 рублей и 1 000 рублей;</li>\r\n	<li>Суперприз - 100 000 рублей.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купи 3 любых продукта Garnier в магазине &laquo;Магнит Косметик&raquo;;</li>\r\n	<li>Отправь СМС на короткий номер 9395 с префиксом Garnier, названием магазина и номером чека;</li>\r\n	<li>Участвуй в розыгрыше призов электронных сертификатов на 500 и на 1000 рублей;</li>\r\n	<li>Главный приз - 100 000 рублей.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(2, 'Акция Nescafe и Ашан: «Миллион поводов для счастья!»', 'Главный денежный приз – 100 000 рублей', '2021-03-05 18:48:18', 'https://www.nescafe.com/ru/promo-auchan', 'uploads/nescafe.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:47:54', '2021-03-05 18:48:18', 0, 'akciya-nescafe-i-ashan-million-povodov-dlya-schastya', '<p>Участвуйте в акции &laquo;Миллион поводов для счастья!&raquo; и получайте призы от Ашан и NESCAF&Eacute;.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Ежедневные призы - Сертификаты номиналом 3000 рублей на покупки в магазинах сети &laquo;Ашан&raquo;;</li>\r\n	<li>Главный денежный приз &ndash; 100 000 рублей, который достанется 10 победителям.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Для участия в акции необходимо купить любую продукцию Nescaf&eacute; в магазинах &laquo;Ашан&raquo; на сумму от 299 рублей, зарегистрировать чек через чат-бот в WhatsApp +7(985) 820-92-21, стать участником розыгрышей призов.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(3, 'Фотоконкурс Whiskas и Pedigree, Ашан: «#МойПушистыйЧемпион»', 'Умные весы', '2021-03-04 21:00:00', 'https://vk.com/wall-53736046_43880', 'uploads/whiskas.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:50:38', '2021-03-05 18:46:56', 0, 'fotokonkurs-whiskas-i-pedigree-ashan-moypushistyychempion', '<p>Участвуй в фотоконкурсе от компании Mars и магазинов &laquo;Ашан&rdquo;. Получи шанс выиграть призы: умные весы, подарочные карты &laquo;Ашан&raquo; на 1000 и 2000 рублей.*</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Умные весы;</li>\r\n	<li>Подарочная карта Ашан номиналом 2000 рублей;</li>\r\n	<li>Подарочная карта Ашан номиналом 1000 рублей.</li>\r\n</ul>\r\n\r\n<h2>Участие в фотоконкурсе:</h2>\r\n\r\n<ol>\r\n	<li>Приобретайте корма компании. Mars, участвующие в конкурсе;</li>\r\n	<li>Публикуйте фото с питомцем и кормом в социальных сетях с хештэгом #МойПушистыйЧемпион;</li>\r\n	<li>Участвуйте в розыгрыше призов.</li>\r\n</ol>\r\n\r\n<p>Продукция, участющая в акции: Whiskas, Pedigree, Kitekat, Sheba,&nbsp;Natures Table, Perfect Fit, Dreamies, Cesar, Chappi.</p>', 0, '', '', '', '', '', '', '', ''),
(4, 'Акция LG: «LG дарит подарки»', 'Саундбар LG SN4.DRUSLLK', '2021-03-20 21:00:00', 'https://rushop.lg.com/blogs/hot_offers/1472443', 'uploads/bdihqmpt.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:53:28', '2021-03-05 18:44:20', 0, 'akciya-lg-lg-darit-podarki', '<p>Участвуйте в зимнем розыгрыше и получайте много подарков от LG!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>телевизор LG OLED55CXRLA.ARU, 1 приз;</li>\r\n	<li>промокод 15%* на все товары, 1 приз;</li>\r\n	<li>промокод 10%* на все товары, 1 приз.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>подать заявку на участие в акции;</li>\r\n	<li>участвовать в розыгрыше призов.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(5, 'Акция Nordman: «Подарки от Nоrdman»', 'Смартфон Apple iPhone SE 2020 64 ГБ', '2021-03-05 18:23:21', 'http://promo.nordman.ru', 'uploads/gtkkardh.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:56:06', '2021-03-05 18:23:21', 0, 'akciya-nordman-podarki-ot-nordman', '<p>Ну что, разыграем iPhone? Или iPad? Или...</p>\r\n\r\n<p>Совершите покупку продукции Nordman на сумму от 3500 рублей и выиграйте один ценных призов.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Планшет 10.2&quot; Apple iPad 2020 Wi-Fi 32 ГБ серый, 1 приз;</li>\r\n	<li>Смартфон Apple iPhone SE 2020 64 ГБ, 1 приз;</li>\r\n	<li>Смарт-часы Apple Watch Series 3 GPS 42mm, 1 приз;</li>\r\n	<li>Беспроводные наушники Apple Airpods (MRXJ2RU/A) белый, 1 приз;</li>\r\n	<li>Смарт-часы Amazfit Bip S Lite, 1 приз;</li>\r\n	<li>Портативная колонка JBL CLIP 3 цвет белый, 1 приз;</li>\r\n	<li>Портативная колонка JBL CLIP 3 цвет черный, 1 приз.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купите продукцию на сайте nordman.ru на сумму не менее 3 500 рублей без учета стоимости доставки;</li>\r\n	<li>Зарегистририруйте покупку на сайте акции и подайте заявку на участие в розыгрыше призов;</li>\r\n	<li>15 марта 2021 года будут определены 7 победителей акции.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(6, 'Конкурс Audi: «Audi Creative Lab»', 'Квадрокоптер DJI Tello Boost Combo', '2021-03-05 18:21:47', 'https://creativelab.audi.ru', 'uploads/ahxl07a7.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 13:58:44', '2021-03-05 18:21:47', 0, 'konkurs-audi-audi-creative-lab', '<p>Выполняй задания, становись амбассадором бренда Audi и выигрывай призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Экшн-камера GoPro HERO 9 Black;</li>\r\n	<li>Видеокамера экшн Sony HDR AS300/WC;</li>\r\n	<li>Квадрокоптер DJI Tello Boost Combo;</li>\r\n	<li>Стабилизатор Zhiyun Smooth Q2;</li>\r\n	<li>Led осветитель Pictar NSL-1;</li>\r\n	<li>Квадрокоптер DJI Tello;</li>\r\n	<li>Публикация конкурсных работ участников-победителей в официальном аккаунте Audi Instagram;</li>\r\n	<li>Худи с изображением бренда Audi.</li>\r\n</ul>\r\n\r\n<h2>Участие в конкурсе:</h2>\r\n\r\n<ul>\r\n	<li>Выполняй задания;</li>\r\n	<li>Получай баллы;</li>\r\n	<li>Выигрывай призы!</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(7, 'Акция Persil: «CAPS - и готово!»', 'Стиральная машина с сушкой Samsung WD80K5410OS', '2021-03-04 21:00:00', 'http://persil-promo.ru', 'uploads/persil_4U6Agp7.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:04:34', '2021-03-05 18:17:13', 0, 'akciya-persil-caps-i-gotovo', '<p>Покупай продукцию Persil&raquo; в формате капсул, регистрируй чеки и выигрывай инновационную технику для дома.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>12 призов по 100 000 рублей.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупайте Persil Caps в магазинах &laquo;Пятёрочка&raquo;;</li>\r\n	<li>Регистрируйте чеки на сайте акции;</li>\r\n	<li>Получи гарантированно 100 руб. на телефон;</li>\r\n	<li>Выигрывай каждую неделю ценные призы.</li>\r\n</ul>\r\n\r\n<p><em>В Акции принимает участие продукция под товарными знаками &laquo;Persil&raquo; в формате капсул.</em></p>', 0, '', '', '', '', '', '', '', ''),
(8, 'Акция Motul: «Dakar 2021»', 'Рюкзак Motul & Thule', '2021-03-05 18:11:15', 'http://dakar.motulcontest.ru', 'uploads/usun70uk.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:09:00', '2021-03-05 18:11:15', 0, 'akciya-motul-dakar-2021', '<p>Палящее солнце, ветер с песком, долгая дорога и самое сумасшедшее ралли-приключение для любого гонщика &mdash; все это &laquo;Дакар&raquo;, который в 2021 году проводится в Саудовской Аравии</p>\r\n\r\n<p>Участвуйте в акции и выигрывайте подарки Motul.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Сумка для шлема - 1 шт.;</li>\r\n	<li>Держатели для телефона - 5 шт.;</li>\r\n	<li>Рюкзак Motul &amp; Thule - 1 шт.;</li>\r\n	<li>Футболки MOTUL Since 1853 - 6 шт.;</li>\r\n	<li>Флешки 32 Гб - 5 шт.;</li>\r\n	<li>Шарф-труба - 5 шт.;</li>\r\n	<li>Бейсболка красная - 5 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<p>Для участия в акции необходимо:</p>\r\n\r\n<ul>\r\n	<li>Совершить покупку продукции&nbsp;Motul c этикеткой c QR-кодом на упаковке;</li>\r\n	<li>Отсканировать QR-код фотокамерой на смартфоне;</li>\r\n	<li>Ввести свой адрес электронной почты или телефон.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(9, 'Акция Milka: «Праздник у нас, подарки у вас!»', 'Ноутбук', '2021-03-05 18:10:12', 'http://120.milka.com', 'uploads/t8vdcr3d.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:14:14', '2021-03-05 18:10:12', 0, 'akciya-milka-prazdnik-u-nas-podarki-u-vas', '<p>Покупайте любую продукцию под товарным знаком &laquo;Milka&raquo; в категории шоколад, шоколадные конфеты, печенье, бисквиты, вафли, изделия кондитерские мучные в количестве, дающем право на получение, как минимум 1 именинной свечки с 01.01.2021 по 31.08.2021 во всех точках продаж продукции &laquo;Milka&raquo;. Регистрируйте кассовый чек на сайте акции www.120.milka.com. Получайте и копите именинные свечки за каждый продукт &laquo;Milka&raquo; в чеке. Получайте гарантированные призы и открывайте доступ к розыгрышам еженедельного, ежемесячного и главного призов. Выигрывайте миллион рублей на исполнение своего желания!<br />\r\nПринимайте участие в специальном розыгрыше. Зарегистрируйте не менее 1 чека в текущем месяце, поделитесь своим заветным желанием на сайте www.120.milka.com и расскажите, почему оно для вас так важно и как давно вы о нём мечтаете. Мilka исполнит самое заветное желание каждый месяц!</p>', 0, '', '', '', '', '', '', '', ''),
(10, 'Акция Dirol: «Dirol дарит подарки»', 'Смартфон Iphone 12 128GB', '2021-03-05 18:09:00', 'http://dirol-promo.ru/', 'uploads/dirol_S4DyIgJ.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:16:28', '2021-03-05 18:09:00', 0, 'akciya-dirol-dirol-darit-podarki', '<p>Участвуй в акции от Dirol и выигрывай крутые призы.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный Приз &ndash; 1 000 000 рублей</li>\r\n	<li>Специальные Призы;</li>\r\n	<li>Еженедельные Призы.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите упаковку жвачки Dirol в акционной обертке. На ней должны быть краткие условия акции, а также код на красном фоне;</li>\r\n	<li>Регистрируйтесь для участия на сайте акции;</li>\r\n	<li>Сохраните полученный чек, который понадобится для получения призов;</li>\r\n	<li>Регистрируйте коды на саайте в личном кабинете;</li>\r\n	<li>Также нужно зарегистрировать чек, указывая его данные.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(11, 'Акция Metabo: «Покупай и выигрывай»', 'Снегоход', '2021-03-05 18:03:25', 'https://promo-metabo.ru', 'uploads/7erdnex8.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:19:01', '2021-03-05 18:03:25', 0, 'akciya-metabo-pokupay-i-vyigryvay', '<p>Участвуй в розыгрыше призов при покупке аккумуляторного инструмента Metabo.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз: снегоход, 1 приз;</li>\r\n	<li>Инструмент Metabo;</li>\r\n	<li>Тюбинг;</li>\r\n	<li>Термокружка.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купи любой аккумуляторный инструмент Metabo;</li>\r\n	<li>Зарегистрируй покупку на сайте акции;</li>\r\n	<li>Получи гарантированный подарок и участвуй в розыгрыше призов.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(12, 'Акция Bosch: «Купил! Измерил! Победил!»', 'Apple MacBook Pro', '2021-03-05 18:02:14', 'http://promo-bosch.ru', 'uploads/bosch.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:21:32', '2021-03-05 18:02:14', 0, 'akciya-bosch-kupil-izmeril-pobedil', '<p>Участвуй в акции и получай подарки от Bosch.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Apple MacBook Pro 13 - 2 шт.;</li>\r\n	<li>Sony playstation 4 pro - 2 шт.;</li>\r\n	<li>Электросамокат XIAOMI MIJIA M365 PRO - 2 шт.;</li>\r\n	<li>Квадрокоптер DJI Mavic Mini Fly More Combo - 2 шт.;</li>\r\n	<li>Измерительный инструмент Bosch UniversalLevel 360 - 3 шт.;</li>\r\n	<li>Измерительный инструмент Bosch GLL 2-15 G - 3 шт.;</li>\r\n	<li>Измерительный инструмент Bosch D TECT 120 - 1 шт.;</li>\r\n	<li>Измерительный инструмент Bosch GCL 2-50 G - 2 шт.;</li>\r\n	<li>Измерительный инструмент Bosch Zamo SET - 2 шт.;</li>\r\n	<li>Измерительный инструмент Bosch PLR 50 C - 3 шт.;</li>\r\n	<li>Подписка на on-line кинотеатр IVI сроком на 3 месяца - 600 шт.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(13, 'Акция BQ: «Угадай счет»', 'Микроволновая печь BQ MWO- 20002ST/BG', '2021-03-05 17:56:04', 'http://spartak.bq.ru/', 'uploads/bq_mrhjEiz.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:27:15', '2021-03-05 17:56:04', 0, 'akciya-bq-ugaday-schet', '<p>Российский бренд электроники BQ совместно с ХК &quot;Спартак&quot; (Москва) представляют конкурс &quot;Угадай счет&quot; и выиграй ценные призы.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Смартфон BQ 6040L Magic - 31 шт.;</li>\r\n	<li>Микроволновая печь BQ MWO- 20002ST/BG - 31 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в конкурсе:</h2>\r\n\r\n<ul>\r\n	<li>Зайти на сайт конкурса;</li>\r\n	<li>Заполнить анкету, угадав сколько забьет голов ХК &quot;Спартак&quot; (Москва) и сколько команда-соперник;</li>\r\n	<li>По итогам каждого домашнего матча мы разыгрываем смартфон BQ Magic, а по итогам каждого гостевого матча &ndash; микроволновую печь BQ.</li>\r\n</ul>\r\n\r\n<p>Розыгрыш проводится среди участников, угадавших счёт матча до его начала. Победитель определяется с помощью генератора случайных чисел random.org</p>', 0, '', '', '', '', '', '', '', ''),
(14, 'Акция Петелинка: «Клуб Моя Петелинка 2.0»', 'Набор посуды для готовки Gipfel', '2021-03-04 21:00:00', 'https://promo.petelinka.ru/', 'uploads/petelinka.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:29:45', '2021-03-05 17:37:23', 0, 'akciya-petelinka-klub-moya-petelinka-2-0', '<p>Обновленный клуб &laquo;Моя Петелинка&raquo; - дарим подарки за покупки! Покупай продукты &laquo;Петелинка&raquo;, регистрируй кассовые чеки и копи баллы, выбирай призы из каталога. Накапливай баллы и учавствуй в розыгрыше ценных призов!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Розыгрыш ценых призов</li>\r\n	<li>Призы накопительной программы</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите продукт &ldquo;Петелинка&rdquo; со специальным стикером;</li>\r\n	<li>Регистрируйте кассовые чеки.</li>\r\n</ul>\r\n\r\n<h2>Копите баллы</h2>\r\n\r\n<h2>Меняйте баллы на подарки</h2>\r\n\r\n<p><em>Каждому участнику дается 2 попытки на розыгрыш подарков:</em></p>\r\n\r\n<ul>\r\n	<li><em>- После первой попытки вы можете забрать подарок (при этом баллы спишутся с вашего счета) или перейти ко второй попытке;</em></li>\r\n	<li><em>- Подарок, выпавший во второй попытке, вы также можете забрать за баллы или отказаться от него, тогда баллы не спишутся.</em></li>\r\n</ul>\r\n\r\n<p><em>Для участия в розыгрышах участник делает невозвратную ставку баллами.</em></p>', 0, '', '', '', '', '', '', '', ''),
(15, 'Акция Holy Corn: «Holy Corn & Likee»', 'Лампа для профессиональной видеосъемки', '2021-03-05 17:32:51', 'https://holycorn.ru/likee', 'uploads/5owhqnn0.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:32:42', '2021-03-05 17:32:51', 0, 'akciya-holy-corn-holy-corn-likee', '<p>Каждая карточка внутри упаковки - гарантированный приз в приложении Likee!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Лампа для профессиональной видеосъемки - 10 шт.,</li>\r\n	<li>Брендированный набор Likee (стикеры, брелоки, бутылка для воды, чехол для пропуска) - 30 шт.;</li>\r\n	<li>Брендированные футболки Likee - 20 шт.;</li>\r\n	<li>Месячный запас продукции Holy Corn - 40 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупайте Holy Corn;</li>\r\n	<li>Находите памятные карточки в каждой пачке;</li>\r\n	<li>Регистрируйте код и обменивайте карточки на призы.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(16, 'Акция Old Spice: «Old Spice Magic Cards»', 'Автомобиль Tesla Standard Range Plus', '2021-03-05 17:31:36', 'https://pgbonus.ru/promos/magic', 'uploads/old-spice.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:35:21', '2021-03-05 17:31:36', 0, 'akciya-old-spice-old-spice-magic-cards', '<p>Участвуй в акции от Old Spice. Разыгрываем сотни супер-заряженных призов. Испытай удачу уже сейчас!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз - автомобиль Tesla Standard Range Plus;</li>\r\n	<li>Призы 1-го уровня:\r\n	<ul>\r\n		<li>iPhone 11 64 Gb - 10 шт.;</li>\r\n		<li>Игровая консоль Sony PlayStation 4 - 10 шт.;</li>\r\n		<li>Яндекс.Станция мини - 130 шт.;</li>\r\n		<li>Фитнес браслет Mi Band 4 - 50 шт.</li>\r\n		<li>Внешний аккумулятор - 200 шт.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Гарантированны награды:\r\n	<ul>\r\n		<li>Промокоды: Яндекс.Плюс, ЛитРес, Premier.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купи любой подарочный набор Old Spice (со стикером/картой внутри);</li>\r\n	<li>Введи код с карты на сайте и сохрани стикер/скретч-карту;</li>\r\n	<li>Получи гарантированный приз и шанс выиграть главный приз или один из множества других.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(17, 'Акция Wella: «WELLA 140 лет мастерства преображений»', 'Стайлер', '2021-03-05 17:29:52', 'https://wella140.ru', 'uploads/wella.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:37:29', '2021-03-05 17:29:52', 0, 'akciya-wella-wella-140-let-masterstva-preobrazheniy', '<p>140 лет - 140 дней подарков. Выиграй 140 000 рублей на преображение.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз - 140 рублей на телефон;</li>\r\n	<li>Ежедневно - 1400 рублей на шопинг;</li>\r\n	<li>Еженедельно - Стайлер;</li>\r\n	<li>Главный приз - 140 000 рублей на преображение.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай 2 продукта Wella;</li>\r\n	<li>Регистрируй чеки на сайте акции;</li>\r\n	<li>Выигрывай призы.</li>\r\n</ul>\r\n\r\n<h2>Продукция, участвующая в акции:</h2>\r\n\r\n<ul>\r\n	<li>Продукции под товарным знаком &laquo;Wellaflex&raquo;, &laquo;Wellaton&raquo;, &laquo;Wella Shockwaves&raquo;, &laquo;Wella Color Perfect&raquo;, &laquo;WellaDeluxe&raquo;.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(18, 'Акция Gourmet: «Соберите коллекцию Гурмэ»', 'Годовой запас корма ГУРМЭ', '2021-03-05 17:28:28', 'https://www.gourmet-cat.ru/promo', 'uploads/gourmet-gold.jpg.500x300_q95.jpg', 1, 0, '2021-02-05 14:40:04', '2021-03-05 17:28:28', 0, 'akciya-gourmet-soberite-kollekciyu-gurme', '<p>Радуйте вашего пушистого гурмана не только вкусным кормом, но и подарками в новой акции Gourmet!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированные призы:\r\n	<ul>\r\n		<li>70 баллов - подушка-лежанка;</li>\r\n		<li>100 баллов - сервировочный столик.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Главный приз - годовой запас корма ГУРМЭ.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупайте корм Gourmet в промо упаковке c 1 декабря по 15 марта в магазинах, участвующих в акции;</li>\r\n	<li>Получайте баллы за каждую покупку при регистрации чека на сайте www.gourmet-cat.ru/promo и в WhatsApp +7 (903) 180-20-16</li>\r\n	<li>Копите и обменивайте их на подарки и получите шанс выиграть Главный приз &ndash; Годовой запас корма!</li>\r\n	<li>Оставьте отзыв о корме ГУРМЭ и получите дополнительно 5 баллов.</li>\r\n</ul>\r\n\r\n<p>Соберите всю коллекцию Gourmet!</p>', 0, '', '', '', '', '', '', '', ''),
(19, 'Акция Принцесса Нури: «Наполняйте дом теплом вместе с чаем Принцесса Нури»', 'Квартира', '2021-03-02 21:00:00', 'https://noori-tea-promo.ru/', 'uploads/princessa-nuri_49QfBwe.jpg.500x300_q95.jpg', 1, 1, '2021-02-05 14:42:07', '2021-03-05 17:26:15', 0, 'akciya-princessa-nuri-napolnyayte-dom-teplom-vmeste-s-chaem-princessa-nuri', '<p>Наполняйте дом теплом вместе с чаем &laquo;Принцесса Нури&raquo;!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз - квартира;</li>\r\n	<li>Гарантированные призы.</li>\r\n</ul>\r\n\r\n<p><em>*Главный приз - сертификат на сумму 2 000 000 рублей на покупку квартиры.</em></p>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купите промоупаковку чая &laquo;Принцесса Нури&raquo; и найдите промокод под крышкой;</li>\r\n	<li>Активируйте промокод на сайте акции;</li>\r\n	<li>Участвуйте в розыгрыше призов.</li>\r\n</ol>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Срок проведения акции - с 01.12.2020 по 30.06.2021 г.;</li>\r\n	<li>Срок регистрации промокодов - с 01.12.2020 г. по 31.05.2021 г.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(20, 'Акция ЗБК: «Традиции подарков»', 'Семейная поездка в Великий Устюг', '2021-03-04 21:00:00', 'https://zbk.ru/традиции-подарков/', 'uploads/zbk.jpg.500x300_q95.jpg', 1, 1, '2021-02-05 14:44:27', '2021-03-05 17:22:08', 0, 'akcia_trad_podarkov', '<p>Дорогие друзья, любите ли вы делать подарки? А получать?</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз - Семейная поездка в Великий Устюг, 5 призов;</li>\r\n	<li>Бонусные и интерактивные сертификаты номиналом 1000 рублей;</li>\r\n	<li>Наборы бытовой химии.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купите любую продукцию брендов Завод Братьев Крестовниковых, Bimax, BiAsept, AOS в магазинах по всей России;</li>\r\n	<li>Зарегистрируйте чеки в личном кабинете на сайте акции;</li>\r\n	<li>Получайте баллы за каждую покупку. Больше чеков - больше баллов!</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(22, 'alcha.l', '60.000', '2021-03-16 21:00:00', 'https://www.instagram.com/alcha.l/', 'uploads/thumb-816x460-alcha_l.jpg', 1, 1, '2021-02-27 19:49:16', '2021-03-25 17:49:47', 1, 'alcha-l', '<p>17 марта 2021 пройдет розыгрыш в Instagram у блогера @alcha.l, она у себя в сторис разыграет 60.000 руб. и выберет 1&nbsp;победителя&nbsp;среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Владиславы: &quot;Для избранного будет вручение, а избранным может быть каждым. Все детали в моем аккаунте.&quot;</p>', 0, '1', 'alcha-l', 'uploads/thumb-816x460-alcha_l.jpg', '<p>ЗАРЕГИСТРИРУЙТЕСЬ И ПРИМИТЕ УЧАСТИЕ В МАСШТАБНОМ РОЗЫГРЫШЕ ПОЛУЧИВ ВОЗМОЖНОСТЬ ВЫИГРАТЬ ДЕНЕЖНЫЙ ПРИЗ.</p>\r\n\r\n<p>Instagram блогер <span class=\"marker\">@alcha.l</span>, розыгрывает 60.000 руб. Розыгрыш будет проходить в марте и у каждого будет возможность получить приз. Всего 1 победитель, именно он получит 60.000 руб, он будет выбран на глазах всех её подписчиков с помощью рандомайзера и победитель получит свой выигрыш.</p>\r\n\r\n<p>Благодаря Вашей регистрации Вы также сможете, в дальнейшем, участвовать в розыгрышах от других организаторов, где будете иметь возможность выигрывать денежные и другие призы.</p>\r\n\r\n<p>В момент регистрации на этом сайте и подтверждения Вашей кредитной карты Вы автоматически подписываетесь на услуги нашего сервиса и получаете 3 дня бесплатного участия в данном розыгрыше и всех иных представленных на нашей платформе wingift.org. Если вы продолжите подписку после 3-х дневного пробного периода у Вас будет доступ к услугам нашей платформы всего за 625 рублей, которые будут списываться раз в 14 дней. После списания 14-ти дневной оплаты нашей платформы вы сохраните доступ к услугам, которые доступны исключительно для участников, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</p>', 'alcha.l', '1', '', ''),
