(29, 'parshuk_ ЛЕНДИНГ', '50.000', '2021-03-17 05:33:14', 'https://www.instagram.com/parshuk_/?igshid=hhtdctdn2j7b', 'uploads/parshuk_.jpg', 0, 0, '2021-03-01 09:10:55', '2021-03-17 05:33:14', 0, 'test', '<div class=\"text__title\">Деньги могут стать твоими!</div>', 1, '1', 'parshuk', 'uploads/photo_2021-03-12 14.58.19.jpeg', '<div class=\"text__title\">ЗАРЕГИСТРИРУЙТЕСЬ И ПРИМИТЕ УЧАСТИЕ В МАСШТАБНОМ РОЗЫГРЫШЕ ПОЛУЧИВ ВОЗМОЖНОСТЬ ВЫИГРАТЬ ДЕНЕЖНЫЙ ПРИЗ.</div>\r\n\r\n<div class=\"text__content\">Instagram блогер <span class=\"marker\">@parshuk_</span> разыгрывает 50.000 руб. Розыгрыш будет проходить 17 марта и у каждого будет возможность получить приз. Всего 10 победителей по 5.000 руб, которые будут выбраны на глазах всех его&nbsp;подписчиков с помощью рандомайзера и каждый победитель получит свой выигрыш.<br />\r\n<br />\r\nБлагодаря Вашей регистрации Вы также сможете, в дальнейшем, участвовать в розыгрышах от других организаторов, где будете иметь возможность выигрывать денежные и другие призы.<br />\r\n<br />\r\nВ момент регистрации на этом сайте и подтверждения Вашей кредитной карты Вы автоматически подписываетесь на услуги нашего сервиса и получаете 3 дня бесплатного участия в данном розыгрыше и всех иных представленных на нашей платформе wingift.org. Если вы продолжите подписку после 3-х дневного пробного периода у Вас будет доступ к услугам нашей платформы всего за 625 рублей, которые будут списываться раз в 14 дней. После списания 14-ти дневной оплаты нашей платформы вы сохраните доступ к услугам, которые доступны исключительно для участников, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</div>', 'parshuk_', '10', 'uploads/photo_2021-03-12 14.58.19.jpeg', 'uploads/photo_2021-03-12 14.58.19.jpeg'),
