ков, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</p>', 'rusikdid', '1', '', ''),
(31, 'sherra.a', '50.000', '2021-03-16 21:00:00', 'https://www.instagram.com/sherra.a/', 'uploads/thumb-816x460-sherra.a.jpg', 1, 1, '2021-03-01 09:14:03', '2021-03-25 17:27:24', 1, 'sherra-a', '<p>27&nbsp;марта 2021 пройдет розыгрыш в Instagram у блогера @sherra.a, она у себя в сторис разыграет 50.000 руб. и выберет 10 победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Шерри: &quot;Для вас, мои любимые! В&nbsp;честь международного&nbsp;женского&nbsp;деня провожу этот конкурс. Все детали можно узнать на личной страничке в сторис&quot;</p>', 0, '1', 'sherra-a', 'uploads/sherra.a.desctop.png', '<div class=\"text__title\">ЗАРЕГИСТРИРУЙТЕСЬ И ПРИМИТЕ УЧАСТИЕ В МАСШТАБНОМ РОЗЫГРЫШЕ ПОЛУЧИВ ВОЗМОЖНОСТЬ ВЫИГРАТЬ ДЕНЕЖНЫЙ ПРИЗ.</div>\r\n\r\n<div class=\"text__content\">Instagram блогер <span class=\"marker\">@sherra.a</span>, в честь международного женского дня, разыгрывает 50.000 руб. Розыгрыш будет проходить 7 марта и у каждого будет возможность получить приз. Всего 10 победителей по 5.000 руб, которые будут выбраны на глазах всех её подписчиков с помощью рандомайзера и каждый победитель получит свой выигрыш.<br />\r\n<br />\r\nБлагодаря Вашей регистрации Вы также сможете, в дальнейшем, участвовать в розыгрышах от других организаторов, где будете иметь возможность выигрывать денежные и другие призы.<br />\r\n<br />\r\nВ момент регистрации на этом сайте и подтверждения Вашей кредитной карты Вы автоматически подписываетесь на услуги нашего сервиса и получаете 3 дня бесплатного участия в данном розыгрыше и всех иных представленных на нашей платформе wingift.org. Если вы продолжите подписку после 3-х дневного пробного периода у Вас будет доступ к услугам нашей платформы всего за 625 рублей, которые будут списываться раз в 14 дней. После списания 14-ти дневной оплаты нашей платформы вы сохраните доступ к услугам, которые доступны исключительно для участников, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</div>', 'sherra.a', '10', 'uploads/sherra.a.tablet.png', 'uploads/sherra.a.mobile.png'),
(32, 'Акция o.b.: «Преобразись»', 'Денежный приз в размере 151 692 руб', '2021-03-05 17:05:58', 'https://www.obpromo.ru/', 'uploads/фото компаний/ob.jpg', 1, 0, '2021-03-01 09:29:09', '2021-03-05 17:05:58', 0, 'akciya-o-b-preobrazis', '<p>Преобразись вместе с&nbsp; o.b. Купи продукцию o.b., зарегистрируй чек и участвуй в розыгрыше призов.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Сертификат - &laquo;Спортмастер&raquo; на 3 000 руб.;</li>\r\n	<li>Сертификат - &laquo;Эльдорадо&raquo; на 3 000 руб.;</li>\r\n	<li>Сертификат - &laquo;РивГош&raquo; на 3 000 руб.;</li>\r\n	<li>Главный Приз - Денежный приз в размере 151 692 руб.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай продукцию o.b.;</li>\r\n	<li>Зарегистрируй чек на сайте акции;</li>\r\n	<li>Получи возможность выиграть призы.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(33, 'Акция Доширак: «Всё преодолеем вместе с \"Доширак\"»', 'Автомобиль', '2021-03-04 21:00:00', 'https://doshirak2021.i-actions.ru/', 'uploads/фото компаний/doshirak.jpg', 1, 0, '2021-03-01 09:32:51', '2021-03-05 17:17:51', 0, 'akciya-doshirak-vse-preodoleem-vmeste-s-doshirak', '<p>&laquo;Всё преодолеем вместе с Доширак!&raquo; и участвуй в розыгрыше призов!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз: промо-коды Литрес/MyBook;</li>\r\n	<li>Денежные призы</li>\r\n	<li>Главный Приз - Автомобиль.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай Акционную продукцию Доширак;</li>\r\n	<li>Найди код внутри акционной продукции;</li>\r\n	<li>Регистрируй код на сайте или по WhatsApp +7(977)800-50-03;</li>\r\n	<li>Получай гарантированный приз промо-коды Литрес/Mybook;</li>\r\n	<li>Участвуй в розыгрыше ценных призов.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(34, 'Акция Рязаночка: «Напеки себе призы!»', 'Бытовая техника на выбор, стоимостью до 47 000 рублей', '2021-03-05 17:02:56', 'https://promo.rmuka.ru', 'uploads/фото компаний/ryazanochka.jpg', 1, 0, '2021-03-01 09:36:12', '2021-03-05 17:02:56', 0, 'akciya-ryazanochka-napeki-sebe-prizy', '<p>С 10 марта 2021 по 10 мая 2021 года участвуйте в акции от Рязаночка: &laquo;Напеки себе призы!&raquo; и выигрывайте ценные призы!</p>\r\n\r\n<p>Участвуйте в еженедельной викторине от Печки, зарабатывайте дополнительные баллы для основного розыгрыша!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Суперприз - бытовая техника на выбор, стоимостью до 47 000 рублей;</li>\r\n	<li>Ежемесячный приз - Миксер Kitfort KT-1348 с брендингом акции;</li>\r\n	<li>Еженедельные приз 3 уровня - Брендированный фартук или книга сладких рецептов от &laquo;Рязаночки&raquo;</li>\r\n	<li>Еженедельный приз 2 уровня - Брендированная кухонная доска;</li>\r\n	<li>Еженедельный приз 1 уровня - Брендированная прихватка;</li>\r\n	<li>Гарантированные приз - подписка на 14 дней в &quot;видеосервисе&quot; START;</li>\r\n	<li>Специальный приз за 100% прохождение викторины от Печки.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупайте продукцию Рязаночка, сохраняйте чеки;</li>\r\n	<li>Регистрируйте чеки на промо-сайте;</li>\r\n	<li>Участвуйте в розыгрыше призов.</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Сроки проведения акции: с 1 марта по 10 июня 2021 г.;</li>\r\n	<li>Период регистрации чеков: с 1 марта по 10 мая 2021 г.;</li>\r\n	<li>Розыгрыш суперпризов: 13 мая 2021 г.;</li>\r\n	<li>Сроки вручения cуперпризов: до 10 июня 2021 г.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(35, 'Акция Curtis: «Дримбиггеры Curtis»', '1 000 000 рублей на исполнение мечты', '2021-03-01 21:00:00', 'https://dreambiggers.curtistea.com/', 'uploads/фото компаний/curtis.jpg', 1, 0, '2021-03-01 09:39:25', '2021-03-05 17:01:11', 0, 'akciya-curtis-drimbiggery-curtis', '<p>Участвуй в акции &laquo;Дримбиггеры Curtis&raquo; и выиграй 1 000 000 рублей на исполнение мечты!</p>\r\n\r\n<p>С 1 марта по 30 апреля покупай продукцию Curtis в любом магазине, регистрируй чеки и стань обладателем крутых призов, созданных в коллаборации с Ольгой Бузовой, а также электронных сертификатов. Главный приз &ndash; 1 000 000 рублей.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<p>Еженедельные призы:</p>\r\n\r\n<ol>\r\n	<li>Промокод на поездки Я.Такси на 300 рублей</li>\r\n	<li>Электронный подарочный сертификат на покупки в Lamoda на 1 000 рублей</li>\r\n	<li>Портативное зарядное устройство</li>\r\n	<li>Термокружка</li>\r\n</ol>\r\n\r\n<p>Ежемесячные призы:</p>\r\n\r\n<ol>\r\n	<li>Электронный подарочный сертификат Ozon.Travel на 10 000 рублей</li>\r\n	<li>Электронный сертификат на покупки в М.Видео на 25 000 рублей</li>\r\n</ol>\r\n\r\n<p>Главный приз - 1 000 000 рублей на исполнение мечты!</p>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>- Купи одну пачку Curtis в любом магазине;</li>\r\n	<li>- Зарегистрируй чек на сайте dreambiggers.curtistea.com</li>\r\n	<li>- Участвуй в розыгрыше призов. Больше чеков &ndash; больше шансов выиграть.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(36, 'Акция Epica: «Больше хочется - больше сбудется!»', 'Денежные средства в размере от 500 000 до 1 000 000 рублей', '2021-03-05 16:59:29', 'https://epicapromo.ru/', 'uploads/фото компаний/epica.jpg', 1, 0, '2021-03-01 09:42:48', '2021-03-05 16:59:29', 0, 'akciya-epica-bolshe-hochetsya-bolshe-sbudetsya', '<p>С 1 марта 2021 года участвуйте в акции от йогуртов Epica. Покупайте продукцию, участвующую в акци, регистрируйте чеки и выигрывайте денежные призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Еженедельный приз - Денежные средства в размере от 500 000 до 1 000 000 рублей - 8 шт.;</li>\r\n	<li>Ежедневный приз - Денежные средства в размере 3000 рублей - 168 шт.;</li>\r\n	<li>Гарантированный приз за регистрацию первого чека - 50 рублей на мобильный телефон - 6160 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Зарегистрируй чек с покупкой от 3-х EPICA на epicapromo.ru;</li>\r\n	<li>Получи кешбэк 50 рублей за регистрацию;</li>\r\n	<li>Выигрывай 3000 рублей каждый день и до 1000 000 рублей каждую неделю.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(37, 'Акция Orbit: «Освежись и выиграй призы!»', 'Подарочный сертфикат на 50 000 руб', '2021-03-04 21:00:00', 'https://orbit-promo.ru/', 'uploads/фото компаний/orbit.jpg', 1, 0, '2021-03-01 09:45:23', '2021-03-05 17:11:26', 0, 'akciya-orbit-osvezhis-i-vyigray-prizy', '<p>С 1 марта 2021 года участвуй в акции от Orbit и выигрывай крутые призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Смартфон;</li>\r\n	<li>Умные часы;</li>\r\n	<li>Экшен-камера;</li>\r\n	<li>Подарочный сертфикат на 50 000 руб.;</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай продукцию Orbit, участвующую в акции;</li>\r\n	<li>Отсканируй пачку на orbir-promo.ru;</li>\r\n	<li>Выиграй мега приза.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', '');
