(38, 'Конкурс Ozon.ru: «Дебаг Подарков»', 'Смартфон Apple iPhone 12 Pro 128GB', '2021-03-05 16:56:29', 'https://ozondev.ru/', 'uploads/фото компаний/Ozon.ru.jpg', 1, 0, '2021-03-01 09:47:21', '2021-03-05 16:56:29', 0, 'konkurs-ozon-ru-debag-podarkov', '<p>Решай задачи, выигрывай призы и забирай их из постаматов Ozon.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз - Смартфон Apple iPhone 12 Pro 128GB;</li>\r\n	<li>23 приза на любой вкус - от робота-пылесоса и игровой гарнитуры до шуруповерта и годового запаса кофе;</li>\r\n	<li>325 подарочных набора.</li>\r\n</ul>\r\n\r\n<h2>Участие в конкурсе:</h2>\r\n\r\n<ul>\r\n	<li>Выбери подарок;</li>\r\n	<li>Реши задачу в личном кабинете на одном из выбранных языков программирования;</li>\r\n	<li>Открой ячейку с призом.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(39, 'Акция Pepsi: «Дома вкуснее»', 'Холодильник Liebherr', '2021-03-01 21:00:00', 'https://www.instagram.com/pepsirussia/', 'uploads/фото компаний/Pepsi.jpg', 1, 0, '2021-03-01 09:49:44', '2021-03-05 16:54:48', 0, 'akciya-pepsi-doma-vkusnee', '<p>Ждешь выходных? Устраивай домашнюю вечеринку в компании друзей и Pepsi!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Холодильник Liebherr - 5 шт.;</li>\r\n	<li>Электронный сертификат &laquo;Футбол&raquo; на подписку к онлайн кинотеатру ОККО на 12 месяцев - 5 шт.;</li>\r\n	<li>Подарочный сертификат &laquo;Оптимум&raquo; на подписку к онлайн кинотеатру ОККО на 12 месяцев - 10 шт.;</li>\r\n	<li>Промокод Delivery Club на 1000 рублей - 15 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<p>Для участия в акции необходимо:</p>\r\n\r\n<ul>\r\n	<li>Сделать фотографию/видеоролик с содержимым холодильника, при этом фотография или видеоролик должны содержать напиток Pepsi;</li>\r\n	<li>Опубликовать полученный результат на личной странице в Сторис в социальной сети &laquo;Instagram&raquo;;</li>\r\n	<li>Отметить аккаунт @pepsirussia.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(40, 'Акция BelVita: «Попробуй СОЖ с BelVita»', 'Электронный сертификат на поездку в горы на территории Российской Федерации для 1 человека номиналом 200 000 рублей', '2021-03-01 21:00:00', 'https://www.instagram.com/p/CLUUdxqLX1b/', 'uploads/фото компаний/BelVita.jpg', 1, 0, '2021-03-01 09:51:57', '2021-03-05 16:50:58', 0, 'akciya-belvita-poprobuy-sozh-s-belvita', '<p>Хотите выиграть ретрит в горах? Или может запас BelVita на месяц? Теперь у вас есть шанс!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Электронный сертификат на поездку в горы на территории Российской Федерации для 1 человека номиналом 200 000 рублей, 1 приз;</li>\r\n	<li>Набор продукции BelVita, 80 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Делитесь своим способом вести СОЖ;</li>\r\n	<li>Делайте фото/видео пост или сторис с одним из продуктов belVita, ставьте #belVitaСОЖ и отмечайте @belvitaru.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(41, 'Акция Milka и Пятерочка, Перекресток: «Искусство нежных поздравлений»', 'Сертификат IVI на 30 дней подписки', '2021-03-01 21:00:00', 'https://x5.milkatender.ru/rules', 'uploads/фото компаний/milkа.jpg', 1, 0, '2021-03-01 09:55:11', '2021-03-05 16:22:40', 0, 'akciya-milka-i-pyaterochka-perekrestok-iskusstvo-nezhnyh-pozdravleniy', '<p>Поздравляйте нежно в магазинах &laquo;Пятерочка&raquo;, &laquo;Перекресток&raquo; с Milka и Егором Кридом.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Сертификаты IVI на 30 дней подписки - гарантированно за загрузку 1-го чека с Весенним ассортиментом Milka;</li>\r\n	<li>Картины по номерам - розыгрыш за 2 чека с Весенним ассортиментом Milka;</li>\r\n	<li>Мерч от Макса - розыгрыш за 3 чека с Весенним ассортиментом Milka;</li>\r\n	<li>Портрет от Макса и Крида - розыгрыш среди всех участников, зарегистрировавших чеки.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупайте продукцию Milka и регистрируйте чеки;</li>\r\n	<li>Открывайте стикеры в виртуальной галерее;</li>\r\n	<li>Выигрывайте арт-мерч и настоящий портрет от Макса Гошко-Данькова и Егора Крида.</li>\r\n</ul>\r\n\r\n<p>Выполняте условия акции и получайте призы. Чем больше загруженных чеков - тем больше шансов выиграть призы.</p>', 0, '', '', '', '', '', '', '', ''),
(42, 'Акция Минутки: «Минуты за минутки»', 'Apple iPhone 12 64Gb', '2021-03-05 15:17:16', 'https://minutki-promo.ru/', 'uploads/фото компаний/minutki.jpg.500x300_q95.jpg', 1, 0, '2021-03-01 09:57:11', '2021-03-05 15:17:16', 0, 'akciya-minutki-minuty-za-minutki', '<p>Участвуй в акции от пельменей Минутки и выигрывай призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Apple iPhone 12 64Gb - 4 шт.;</li>\r\n	<li>Гарантированные призы - 100 рублей на счет мобильного телефона за каждые 3 зарегистрированных кода - 40 000 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай пельмени Минутки с акционным стикером;</li>\r\n	<li>Находи код под наклейкой;</li>\r\n	<li>Регистрируй код на сайте или отправляй смс на номер +79266611661.</li>\r\n</ul>\r\n\r\n<p>Больше кодов = Больше шансов!</p>', 0, '', '', '', '', '', '', '', ''),
(43, 'Акция Polaris: «Подарок за отзыв!»', 'Кухонные весы PKS 0539DMT', '2021-03-04 21:00:00', 'https://www.polar.ru/priz', 'uploads/фото компаний/polar_priz.jpg', 1, 0, '2021-03-01 09:59:43', '2021-03-05 15:41:16', 0, 'akciya-polaris-podarok-za-otzyv', '<p>Не упусти шанс получить классный подарок за отзыв на приобретенный товар Polaris.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>- 500 руб. на мобильный телефон - неограниченное кол-во;</li>\r\n	<li>- Кухонные весы PKS 0539DMT - 500 шт.;</li>\r\n	<li>- Стайлер PHS 2091KO - 500 шт.;</li>\r\n	<li>- Расческа-выпрямитель PHS 3245KD - 500 шт.;</li>\r\n	<li>- Газовая зажигалка PGL 4001 - 500 шт.;</li>\r\n	<li>- Набор пилок для маникюра и педикюра 9-в-1 PNF 1009 - 500 шт.;</li>\r\n	<li>- Педикюрный набор для ухода за кожей PSR 0801 - 500 шт.;</li>\r\n	<li>- Педикюрный набор для ухода за кожей PSR 1016R - 500 шт.;</li>\r\n	<li>- Крышка Standable Lid SL-20 из термостойкого стекла &Oslash;20 см - 500 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Напиши объективный и развернутый отзыв о приобетенном товаре Polaris, опубликуй его на сайте магазина, где была совершена покупка;</li>\r\n	<li>Запоони небольшую анкету на сайте конкурса, прикрепи фото чека, скриншот отзыва и ссылку на него. Не забудь указать выбранный подарок!</li>\r\n	<li>Ожидай свой подарок. Polaris бесплатно отправит его в любой город России.</li>\r\n</ol>\r\n\r\n<p><em>*Каждый участник может получить не более 6 (шести) подарков за время проведения акции.</em></p>', 0, '', '', '', '', '', '', '', ''),
(44, 'Акция Перекресток: «Детские кассы»', 'Гироскутер MIZAR MZ 10.5', '2021-03-04 21:00:00', 'https://perekrestok-aktsii.ru/akciya-perekrestok-detskie-kassy/', 'uploads/фото компаний/vprok.jpg', 1, 0, '2021-03-01 10:01:54', '2021-03-05 15:42:14', 0, 'akciya-perekrestok-detskie-kassy', '<p><em>Участвуйте в розыгрыше призов от Семейного Клуба!</em></p>\r\n\r\n<p><strong>Для того, чтобы принять участие в акции:</strong></p>\r\n\r\n<ul>\r\n	<li>Необходимо вступить в Семейный Клуб в приложении;</li>\r\n	<li>Посетить супермаркеты Перекрёсток, в котором установлены детские кассы;</li>\r\n	<li>Совершить покупки от 1200 рублей с Картой Клуба;</li>\r\n	<li>Участвовать в розыгрыше призов.</li>\r\n</ul>\r\n\r\n<p><strong>Ваши призы:</strong></p>\r\n\r\n<p>Велосипед Электра, 3 приза;</p>\r\n\r\n<p>Гироскутер MIZAR MZ 10.5, 3 приза;</p>\r\n\r\n<p>Умная колонка Яндекс, 5 призов;</p>\r\n\r\n<p>Сертификат Лего номиналом 10 000 рублей, 27 призов;</p>\r\n\r\n<p>Набор конфет (Fruittella, Mentos, Chupa Chups, Sula, Meller), 27 призов;</p>\r\n\r\n<p>Аэрохоккей, 45 призов;</p>\r\n\r\n<p>Скидки и повышенные баллы за покупки.</p>', 0, '', '', '', '', '', '', '', ''),
(45, 'Акция IQ: «IQ на миллион»', 'Денежный приз в размере 1 000 000 рублей', '2021-03-04 21:00:00', 'https://www.iq-million.ru/', 'uploads/фото компаний/caw241ea.jpg.500x300_q95.jpg', 1, 0, '2021-03-01 10:03:53', '2021-03-05 15:43:41', 0, 'akciya-iq-iq-na-million', '<p>А Ваш IQ на миллион? Получите возможность выиграть 1 000 000 рублей в акции &laquo;IQ на миллион&raquo;!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз: денежный приз в размере 1 000 000 рублей;</li>\r\n	<li>Денежный приз в размере 250 000 рублей, ежемесячный приз.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Покупай офисную бумагу IQ;</li>\r\n	<li>Регистрируй коды со стикеров на упаковках бумаги;</li>\r\n	<li>Выигрывай 250 000 рублей каждый месяц или Главный приз - 1 000 000 рублей.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(46, 'Акция Danone и Активиа, Перекресток: «Давай полегче! в Перекрестке»', 'Денежный сертификат на 100 000 руб', '2021-03-04 21:00:00', 'https://action.danone.ru/perekrestok/', 'uploads/фото компаний/Danone и Активиа.jpg', 1, 0, '2021-03-01 10:05:40', '2021-03-05 16:42:25', 0, 'akciya-danone-i-aktivia-perekrestok-davay-polegche-v-perekrestke', '<p><strong>Для того, чтобы принять участие в акции:</strong></p>\r\n\r\n<ul>\r\n	<li>Нужно приобрести от 4 любых продукта Активиа и Данон в торговой сети &laquo;Перекрёсток&raquo;;</li>\r\n	<li>Зарегистрировать чеки на сайте акции;</li>\r\n	<li>Получить шанс выиграть призы.</li>\r\n</ul>\r\n\r\n<p><strong>Ваши призы:</strong></p>\r\n\r\n<p>10000 баллов на карту &laquo;Перекрёсток&raquo;;</p>\r\n\r\n<p>Сертификат Рив Гош номиналом&nbsp; 3000 рублей;</p>\r\n\r\n<p>Сертификат номиналом 100000 рублей.</p>', 0, '', '', '', '', '', '', '', ''),
(47, 'Акция Gillette: «Купи Gillette, получи шанс выиграть поездку на Полу-финал Лиги Чемпионов»', 'Поездка на полу-финал Лиги Чемпионов на двоих', '2021-03-05 16:41:05', 'https://pgbonus.ru/promos/championsleague', 'uploads/фото компаний/Gillette.png', 1, 0, '2021-03-01 10:07:29', '2021-03-05 16:41:05', 0, 'akciya-gillette-kupi-gillette-poluchi-shans-vyigrat-poezdku-na-polu-final-ligi-chempionov', '<p>Получи шанс выиграть поездку на Полу-финал Лиги Чемпионов вместе с Gillette!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз - поездка на полу-финал Лиги Чемпионов на двоих, 1 приз;</li>\r\n	<li>Игровая приставка Sony PlayStation 5, 6 призов;</li>\r\n	<li>Гарантированный подарок - 200 рублей на счет мобильного телефона.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купи Gillette с лого UEFA Champions League на сумму от 900 рублей и сохрани чек;</li>\r\n	<li>Зарегистрируй чек на сайте акции;</li>\r\n	<li>Получи шанс выиграть поездку на полуфинал UEFA Champions League и игровую приставку каждую неделю.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(48, 'Акция Always и Naturella, Лента: «Night Drive в Ленте»', 'Подарочная карта Askona номиналом 50 000 рублей', '2021-03-05 16:39:49', 'https://pgbonus.ru/promos/night-lenta', 'uploads/фото компаний/Always и Naturella.png', 1, 0, '2021-03-01 10:10:21', '2021-03-05 16:39:49', 0, 'akciya-always-i-naturella-lenta-night-drive-v-lente', '<p>Купи ночные Always или Naturella в магазинах &laquo;Лента&raquo; и получи шанс выиграть призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Приз первого уровня - Подарочная карта Askona номиналом 50 000 рублей - 4 шт.;</li>\r\n	<li>Приз второго уровня - Электронный сертификат Ozon номиналом 4 000 рублей - 40 шт.;</li>\r\n	<li>Приз третьего уровня - 1000 баллов на карту Лента - 100 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купи ночные Always или Naturella в сети магазинов &laquo;Лента&raquo;;</li>\r\n	<li>Зарегистрируй чек на night-lenta.pgbonus.ru в течение 96 часов;</li>\r\n	<li>Получи шанс выиграть призы.</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Сроки проведения Акции с 24.02.2021г. по 30.04.2021г.;</li>\r\n	<li>Сроки совершения покупок и приема заявок с 24.02.2021г. по 31.03.2021г.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(49, 'Акция Фетакса: «Фетакса дарит комплименты»', 'Сертификат OZON номинальной стоимостью 3 000 рублей', '2021-03-05 16:01:17', 'https://www.gastronom.ru/digest/2021/fetaxa/', 'uploads/фото компаний/fetaksa.jpg.500x300_q95.jpg', 1, 0, '2021-03-01 10:12:10', '2021-03-05 16:01:17', 0, 'akciya-fetaksa-fetaksa-darit-komplimenty', '<p>Получите рецепт с фетаксой специально для вас, а также получите возможность выиграть подарочный сертификат&nbsp; Ozon.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Сертификат OZON номинальной стоимостью 3 000 рублей - 10 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Выберите свой любимый ингредиент;</li>\r\n	<li>Получите рецепт на основе вашего любимого ингредиента;</li>\r\n	<li>Выиграйте сертификат OZON номиналом 3 000 ₽.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(50, 'Акция Axe Effect и Пятерочка: «Талант притягивает призы!»', 'Сертификат на онлайн мастер-класс от Дмитрия Красилова', '2021-03-04 21:00:00', 'https://www.promonado.ru/axetalent', 'uploads/фото компаний/Axe.jpg', 1, 0, '2021-03-01 10:15:42', '2021-03-05 17:07:39', 0, 'akciya-axe-effect-i-pyaterochka-talant-prityagivaet-prizy', '<p>Купите продукт AXE в сети магазинов &laquo;Пятёрочка&raquo; и получите шанс выиграть видео мастер-класс со звездой и крутые призы от AXE.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз &ndash; 100 баллов на &laquo;Выручай-карту&raquo;.</li>\r\n	<li>Еженедельные призы:\r\n	<ul>\r\n		<li>Худи &laquo;AXE&raquo;. Общее количество призов &ndash; 50 шт.</li>\r\n		<li>Поясная сумка &laquo;AXE&raquo;. Общее количество призов &ndash; 50 шт.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Главные призы:\r\n	<ul>\r\n		<li>Сертификат на онлайн мастер-класс от Дмитрия Красилова. По итогам акции разыгрывается 1 приз.</li>\r\n		<li>Сертификат на онлайн мастер-класс от Славы Исакова. По итогам акции разыгрывается 1 приз.</li>\r\n		<li>Сертификат на онлайн мастер-класс от Жени Савина рублей. По итогам акции разыгрывается 1 приз.</li>\r\n		<li>Беспроводные наушники PIONEER SE-MJ771BT, стоимостью 9 110 рублей. По итогам акции разыгрывается 16 призов.</li>\r\n		<li>Сертификат на кроссовки &laquo;Lamoda&raquo;, номиналом 10 000,00 рублей. По итогам акции разыгрывается 16 призов.</li>\r\n		<li>Сертификат на онлайн-обучение на выбор победителя (спорт, танцы, музыка) номиналом 15 000 рублей. По итогам акции разыгрывается 16 призов.</li>\r\n	</ul>\r\n	</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(51, 'Акция ТВ-3: «Последний герой 3»', 'Поездка на Занзибар', '2021-03-05 16:37:19', 'https://tv3.ru/casting/posledny-geroi', 'uploads/фото компаний/TV-3.jpg', 1, 0, '2021-03-01 10:18:38', '2021-03-05 16:37:19', 0, 'akciya-tv-3-posledniy-geroy-3', '<p>Хочешь стать последним героем? Участвуй в битве племен! Выиграй поездку на съёмки финала шоу в Занзибаре!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Поездка на Занзибар, 1 приз;</li>\r\n	<li>Ноутбук Apple MacBook Pro 13 (2020), 1 приз;</li>\r\n	<li>Смартфон Apple iPhone 12 Pro (128GB), 1 приз;</li>\r\n	<li>Смартфон Apple iPhone 12 Pro (64GB), 1 приз;</li>\r\n	<li>Планшет Apple iPad 32Gb Wi-Fi (2020), 1 приз;</li>\r\n	<li>Брендированный набор, 20 призов;</li>\r\n	<li>Подписка PREMIER на 1 месяц, 20 000 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Участвуй в онлайн-битве племен ВКонтакте VS Одноклассники Проходи испытания на сайте;</li>\r\n	<li>Смотри выпуски шоу в эфире ТВ-3 Сканируй QR-код. Ищи тайники с подарками в 12 городах;</li>\r\n	<li>Стань победителем и забери трофеи битвы MacBook, iPhone 12 и 12 Pro, iPad.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(53, 'Акция Kinder Chocolate: «Играй и узнавай! Африка»', 'Акция Johnsons Baby и Пятерочка, Перекресток: «Дарите экспертный уход от Johnson’s»', '2021-03-08 21:00:00', 'https://promo.johnsonsbaby.ru', 'uploads/фото компаний/johnsons-baby.jpg', 1, 0, '2021-03-05 18:55:06', '2021-03-09 16:18:39', 0, 'akciya-kinder-chocolate-igray-i-uznavay-afrika', '<p>Боссы рекомендуют: выбирайте экспертный уход от Johnson&#39;s.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз - промокод на портал mirkid.ru с контентом для детей (5 000 шт.);</li>\r\n	<li>Ежедневно - Сертификаты на 1000 руб. магазинов &laquo;Перекресток&raquo; и &laquo;Пятерочка&raquo; (всего 244 шт.);</li>\r\n	<li>Еженедельно - 4К телевизоры (всего 9 шт.).</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите 2 продукта Johnson&rsquo;s в магазинах сети &laquo;Пятерочка или &laquo;Перекресток&raquo;;</li>\r\n	<li>Зарегистрируйте&nbsp;QR-код чека на сайте promo.johnsonsbaby.ru</li>\r\n	<li>Участвуйте в розыгрыше призов.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(54, 'Акция Continental: «Полный бак впечатлений»', 'Промокод номиналом 4000 рублей', '2021-04-14 21:00:00', 'https://continental.afisha.ru/', 'uploads/фото компаний/jv5quaj7.jpg', 1, 0, '2021-03-09 16:17:14', '2021-03-09 16:18:24', 0, 'akciya-continental-polnyy-bak-vpechatleniy', '<p>Дарим топливо за покупку! Continental и &laquo;Afisha Daily&raquo; помогут вам пополнить вашу картину России новыми впечатлениями. Заправляйтесь бесплатно при покупке комплекта шин и отправляйтесь по впечатляющим маршрутам.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Промокод номиналом 4000 рублей (за покупки шин от R20+);</li>\r\n	<li>Промокод номиналом 3500 рублей (за покупки шин от R18 по R19);</li>\r\n	<li>Промокод номиналом 2000 рублей (за покупки шин от R16 по R17);</li>\r\n	<li>Промокод номиналом 1000 рублей (за покупки шин от R13 по R15).</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите летние шины Continental;</li>\r\n	<li>Зарегистрируйте покупку в приложении ContiAssist;</li>\r\n	<li>Получите топливо от Яндекс заправки.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(55, 'Конкурс Audi: «Audi Creative Lab»', 'Экшн-камера GoPro HERO 9 Black', '2021-04-08 21:00:00', 'https://creativelab.audi.ru/', 'uploads/фото компаний/Audi.jpg', 1, 0, '2021-03-09 16:20:49', '2021-03-09 16:21:29', 0, 'konkurs-audi-audi-creative-lab-1', '<p>Выполняй задания, становись амбассадором бренда Audi и выигрывай призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Экшн-камера GoPro HERO 9 Black;</li>\r\n	<li>Видеокамера экшн Sony HDR AS300/WC;</li>\r\n	<li>Квадрокоптер DJI Tello Boost Combo;</li>\r\n	<li>Стабилизатор Zhiyun Smooth Q2;</li>\r\n	<li>Led осветитель Pictar NSL-1;</li>\r\n	<li>Квадрокоптер DJI Tello;</li>\r\n	<li>Публикация конкурсных работ участников-победителей в официальном аккаунте Audi Instagram;</li>\r\n	<li>Худи с изображением бренда Audi.</li>\r\n</ul>\r\n\r\n<h2>Участие в конкурсе:</h2>\r\n\r\n<ul>\r\n	<li>Выполняй задания;</li>\r\n	<li>Получай баллы;</li>\r\n	<li>Выигрывай призы!</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(56, 'Акция Барни: «Барни #времяпоздравлений»', 'Карманный проектор CINEMOOD МУЛЬТиКУБИК', '2021-03-21 18:24:05', 'https://www.instagram.com/p/CK5qe1BHDHQ/', 'uploads/фото компаний/Barni.jpg', 1, 0, '2021-03-09 16:25:37', '2021-03-09 16:25:37', 0, 'akciya-barni-barni-vremyapozdravleniy', '<p>Начинается сезон праздников! И так хочется по-особенному поздравить своих близких. У Барни есть отличная идея: участвуйте в конкурсе поздравлений и выигрывайте призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Карманный проектор CINEMOOD МУЛЬТиКУБИК - 7 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Сканируйте QR-код внутри праздничной упаковки Барни 240г.</li>\r\n	<li>Делайте селфи в праздничной рамке и выкладывайте в Instagram с поздравлением и #БарниВремяПоздравлений</li>\r\n	<li>Авторам самых тёплых поздравлений Барни подарит детский проектор, который сможет превратить любую гостиную в семейный кинозал!</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(57, 'Акция Meine Liebe: «Прозрачные отношения»', 'Сертификат на 100 000 руб', '2021-04-29 18:30:52', 'https://www.instagram.com/tresemme_russia/', 'uploads/фото компаний/meine-liebe.jpg', 1, 0, '2021-03-09 16:31:04', '2021-03-09 16:31:04', 0, 'akciya-meine-liebe-prozrachnye-otnosheniya', '<p>У нас стартует супер акция &laquo;Оживи енота!&raquo;. Мы дарим помощников &ndash; домашние машинки: мощные миксеры, отличные утюги, роботы-пылесосы и стиральные машины. Не упустите шанс, призы разыгрываются каждую неделю!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Суперприз - Сертификат на 100 000 руб.;</li>\r\n	<li>Еженедельные призы - Сертификаты номиналом 25 000 руб. и 10000 руб.;</li>\r\n	<li>Гарантированный приз &ndash; 25 руб. на счет телефона.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите любой продукт Meine Liebe с 14.02.21-29.04.21, на любую сумму и в любом магазине;</li>\r\n	<li>Загрузите фото чека с QR-кодом на сайт enot.meineliebe.ru и получите гарантированный подарок за регистрацию &ndash; 25 руб. на счет телефона;</li>\r\n	<li>Участвуйте в розыгрыше машинок (миксер, утюг, пылесос, стиральная машинка) каждую неделю!</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(58, 'Акция SILK PLASTER: «Превращаем отзывы в призы. Фантастическая Акция от SILK PLASTER»', 'Apple iPhone 12 Mini 128GB', '2022-01-12 18:33:41', 'https://www.plasters.ru/info/promotion/prevrashchaem-otzyvy-v-prizy-volshebnaya-aktsiya-ot-silk-plaster/10958/', 'uploads/фото компаний/silk-plaster.jpg', 1, 0, '2021-03-09 16:37:22', '2021-03-09 16:37:22', 0, 'akciya-silk-plaster-prevrashchaem-otzyvy-v-prizy-fantasticheskaya-akciya-ot-silk-plaster', '<p>С 1 февраля по 30 ноября 2021 года запиши отзыв о материале брендов SILK PLASTER или VICTORIA DU MONDE, оставляй комментарии под постами на официальных страницах SILK PLASTER в социальных сетях и интернет-ресурсах и участвуй в розыгрыше призов.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>1 место - смартфон Apple iPhone 12 Mini 128GB;</li>\r\n	<li>2 место - умные часы Apple Watch Series 6, 40 мм;</li>\r\n	<li>3 место - беспроводные наушники Apple AirPods Pro;</li>\r\n	<li>Cертификат Ozon.ru номиналом 3000 рублей/сертификат Plasters.ru номиналом 5000 рублей, 10 призов;</li>\r\n	<li>Cертификат Ozon.ru номиналом 2000 рублей/сертификат Plasters.ru номиналом 3500 рублей, 10 призов;</li>\r\n	<li>Cертификат Ozon.ru номиналом 1000 рублей/сертификат Plasters.ru номиналом 2000 рублей, 10 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>С 1 февраля по 30 ноября 2021 года запиши отзыв о материале брендов SILK PLASTER или VICTORIA DU MONDE (фото или видео);</li>\r\n	<li>Отправь свою работу на сайт акции;</li>\r\n	<li>Участвуй в розыгрыше IPhone и других призов.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(59, 'Акция Whiskas: «День кошек 2021»', 'Массажное кресло', '2021-04-30 18:44:47', 'http://catday.ru/', 'uploads/фото компаний/whiskas.jpg', 1, 0, '2021-03-09 16:45:12', '2021-03-09 16:45:12', 0, 'akciya-whiskas-den-koshek-2021', '<p>Покупайте продукцию для кошек Whiskas, Sheba, Perfect Fit, Nature&#39;s Table, Dreamies, Kitekat, Catsan, Eliott на сумму от 150 руб., регистрируйте чеки и выигрывай призы</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз - 50 рублей на счет мобильного телефона (120 000 шт.);</li>\r\n	<li>Лежанка для котика (450 шт.);</li>\r\n	<li>Ароматический диффузор (270 шт.);</li>\r\n	<li>Плед (45 шт.);</li>\r\n	<li>Воздухоувлажнитель (45 шт.);</li>\r\n	<li>Умная колонка Яндекс (27 шт.);</li>\r\n	<li>Главный приз - массажное кресло (2 шт.)</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купите продукцию для кошек: Whiskas, Sheba, Perfect Fit, Nature&#39;s Table, Dreamies, Kitekat, Catsan, Eliott на сумму от 150 рублей;</li>\r\n	<li>Зарегистрируйте покупку на сайте акции и получите кэшбэк 50 рублей;</li>\r\n	<li>Получите шанс выиграть другие призы.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(60, 'Акция Felix: «Felix КОШбэк 2021»', 'Электронный сертификат «Ozon» номиналом 120 000 руб.', '2021-03-31 18:46:37', 'https://felix-club.ru/cashback', 'uploads/фото компаний/Felix.png', 1, 0, '2021-03-09 16:47:38', '2021-03-09 16:47:38', 0, 'akciya-felix-felix-koshbek-2021', '<p>Получайте 50 рублей за регистрацию и кешбек за покупки!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз &ndash; Электронный сертификат &laquo;Ozon&raquo; номиналом 120 000 руб. &ndash; 1 шт.;</li>\r\n	<li>Еженедельный приз - Электронный сертификат &laquo;Озон&raquo; номиналом 4 000 руб. - 70 шт.;</li>\r\n	<li>Кэшбэк за покупку:\r\n	<ul>\r\n		<li>7 рублей за покупку Продукции на 149 рублей;</li>\r\n		<li>36 рублей за покупку Продукции на 399 рублей;</li>\r\n		<li>250 рублей за покупку Продукции на 999 рублей.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Совершите покупку в любом магазине на любую сумму.</li>\r\n	<li>Сохраните чек, если внизу распечатан квадратный QR-код.</li>\r\n	<li>Нажмите кнопку сканирования и наведите телефон на QR-код в чеке. Чек нужно отсканировать в течение 72 часов после покупки.</li>\r\n	<li>Для вывода средств у вас должно быть не менее 36 ₽ кэшбэка без учета начислений за регистрацию, приглашение друзей и других бонусов.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(61, 'Акция Klatz и Лента: «KLATZ и Лента»', '3 сертификата в «Ленту» номиналом 5 000 руб.', '2021-04-30 18:49:01', 'https://kids.klatz.pro/', 'uploads/фото компаний/klatz.jpg', 1, 0, '2021-03-09 16:49:21', '2021-03-09 16:49:21', 0, 'akciya-klatz-i-lenta-klatz-i-lenta', '<p>Покупайте зубные пасты Kids и Baby от KLATZ в магазинах &laquo;Лента&raquo; и выигрывайте призы каждую неделю!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Каждую неделю - 3 сертификата в &laquo;Ленту&raquo; номиналом 5 000 руб.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите зубную пасту или щётку KLATZ в сети магазинов &laquo;Лента&raquo; с 1 февраля по 30 апреля 2021г.;</li>\r\n	<li>Укажите свои данные и загрузите чек на этом сайте. Обязательно сохраняйте чек до момента вручения призов;</li>\r\n	<li>Обязательно подпишитесь на наш Instagram: @klatz.pro</li>\r\n	<li>Разыгрываем 3 сертификата в &laquo;Ленту&raquo; номиналом 5 000 руб. каждую неделю. Победители в нашем Instagram</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Акция проходит с 01.02.2021 по 30.04.2021;</li>\r\n	<li>Победители будут выбираться каждую пятницу, начиная с 12 февраля;</li>\r\n	<li>Окончательный результат акции будет подведён после 04.05.2021;</li>\r\n	<li>К участию принимаются чеки, которые выданы с 1 февраля по 30 апреля 2021 года.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(62, 'Акция Gliss Kur и Перекресток: «Краски весны! В сети «Перекрёсток»', '100 000 руб.', '2021-05-31 18:55:09', 'http://promoglisskur.schwarzkopf.ru/', 'uploads/фото компаний/gliss-kur.jpg', 1, 0, '2021-03-09 16:55:30', '2021-03-09 16:55:30', 0, 'akciya-gliss-kur-i-perekrestok-kraski-vesny-v-seti-perekrestok', '<p>Делай что любишь. Gliss Kur восстановит.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Гарантированный приз: 500 баллов на карту &laquo;Перекрёсток&raquo;;</li>\r\n	<li>Еженедельно: Сертификат на 20 000 руб. на покупки в Перекрестке (13 шт.);</li>\r\n	<li>Главный приз: 100 000 руб. (3 шт.)</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Купите 2 любых продукта Gliss Kur с картой клуба Перекрёсток;</li>\r\n	<li>Зарегистрируйте чек на сайте;</li>\r\n	<li>Участвуйте в розыгрыше призов!</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Общий срок проведения Акции - с &laquo;01&raquo; марта 2021 года по &laquo;31&raquo; мая 2021 года;</li>\r\n	<li>Период приобретения товара, участвующего в акции и регистрации на Сайте Акции: с &laquo;01&raquo; марта 2021 года по &laquo;31&raquo; мая 2021 года (включительно);</li>\r\n	<li>Период проведения розыгрыша призов Акции: с &laquo;11&raquo; марта 2021 г. по &laquo;06&raquo; июня 2021 г.;</li>\r\n	<li>Срок выдачи призов Победителям Акции: с &laquo;15&raquo; марта 2021 года по &laquo;30&raquo; июня 2021 года.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(63, 'Акция NIVEA и Пятерочка: «Кошки-рыбки»', 'Cертификат на шоппинг', '2021-03-31 18:56:57', 'https://www.nivea.ru/highlights/cat-or-fish', 'uploads/фото компаний/nivea.jpg', 1, 0, '2021-03-09 16:57:43', '2021-03-09 16:57:43', 0, 'akciya-nivea-i-pyaterochka-koshki-rybki', '<p>Покупайте продукцию Nivea по уходу за кожей в магазинах &laquo;Пятерочка&raquo; и выигрывайте призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Ежедневно:\r\n	<ul>\r\n		<li>2 участника команды, набравшей меньше голосов, получают 50 000 баллов на Выручай-карту;</li>\r\n		<li>2 участника лидирующей команды получают фотоаппарат instax 11 mini.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Главный приз: сертификат на шоппинг.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>С 1 по 31 марта 2021 года купите любой продукт по уходу за кожей NIVEA в магазинах &laquo;Пятёрочка&raquo;;</li>\r\n	<li>Зарегистрируйте чек на сайте nivea.ru или через чат-бот NIVEA в Viber;</li>\r\n	<li>Отдайте свой голос за команду NYUSHA (&laquo;кошечки&raquo;) или команду АСТИ (&laquo;рыбки&raquo;);</li>\r\n	<li>Участвуйте в розыгрыше призов!</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Общий срок проведения Акции, включая срок выдачи призов: с 01 марта 2021 года по 30 апреля 2021 года включительно;</li>\r\n	<li>Период приобретения продуктов для участия в Акции: с 00 часов 01 минуты 01 секунды по московскому времени 01 марта 2021 года по 23 часа 59 минут 59 секунд по московскому времени 31 марта 2021 года;</li>\r\n	<li>Общий период выдачи призов: с 10 апреля 2021 г. по 30 апреля 2021 г. включительно.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(64, 'Акция Дикси: «Масленица в Дикси»', 'Купон на скидку 100% на один товар из списка.', '2021-03-14 18:59:09', 'https://vk.com/app7763188', 'uploads/фото компаний/dixi.jpg', 1, 0, '2021-03-09 16:59:27', '2021-03-09 16:59:27', 0, 'akciya-diksi-maslenica-v-diksi', '<p>Участвуй игре от &laquo;Дикси&raquo;, получи возможность выиграть скидочные купоны.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Купон на скидку 10% на весь чек от 777 рублей;</li>\r\n	<li>Купон на скидку 100% на один товар из списка.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Испытай удачу в игре! Получи возможность выиграть скидочные купоны в Дикси.*</li>\r\n	<li>Чтобы регулировать силу вращения барабана, нажми кнопку &laquo;крутить&raquo;, когда шкала силы заполнится до нужного уровня.</li>\r\n	<li>Ты можешь получить дополнительные попытки. Для этого или кликни по кнопке &ldquo;+&rdquo; вверху и выполняй задания, или дождись паузы в 5 часов.</li>\r\n	<li>В случае выигрыша купон** со скидкой будет отправлен в личные сообщения. Для этого нужно разрешить сообществу Дикси отправлять сообщения. В одной попытке можно выиграть максимум один купон.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(65, 'Акция Alpen Gold и Лента: «Свежий взгляд на себя вместе с Alpen Gold» в торговой сети «Лента»', 'Беговая дорожка', '2021-03-23 19:01:33', 'https://lenta.alpengold.me/', 'uploads/фото компаний/alpen_gold.jpg', 1, 0, '2021-03-09 17:01:52', '2021-03-09 17:01:52', 0, 'akciya-alpen-gold-i-lenta-svezhiy-vzglyad-na-sebya-vmeste-s-alpen-gold-v-torgovoy-seti-lenta', '<p>Покупай 2 Alpen Gold в магазинах &laquo;Лента&raquo;, регистрируй чек и получай призы!</p>\r\n\r\n<p>Призы:</p>\r\n\r\n<ul>\r\n	<li>Еженедельные призы:\r\n	<ul>\r\n		<li>1000 баллов на карту Лента - 200 шт.;</li>\r\n		<li>Фитнес браслет - 40 шт.;</li>\r\n		<li>Спортивные наушники - 4 шт.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Главный приз - беговая дорожка - 1 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай 2 любых Alpen Gold в торговой сети &laquo;Лента&raquo; с картой лояльности;</li>\r\n	<li>Регистрируй чек от покупки;</li>\r\n	<li>Участвуй в розыгрыше призов.</li>\r\n</ul>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Общий срок проведения Акции с 24.02.2021 по 30.04.2021;</li>\r\n	<li>Срок регистрации чеков с 24.02.2021 по 23.03.2021.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(66, 'Акция М.Видео: «Подарки любимым»', 'Телевизор Samsung UE50TU7170U', '2021-03-14 19:03:24', 'https://igra.mvideo.ru/', 'uploads/фото компаний/mvideo.jpg', 1, 0, '2021-03-09 17:03:38', '2021-03-09 17:03:38', 0, 'akciya-m-video-podarki-lyubimym', '<p>Собирай подарки, зарабатывай баллы и выиграй приз.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Телевизор Samsung UE50TU7170U, 1 приз;</li>\r\n	<li>Наушники True Wireless JBL T100 Black, 10 призов;</li>\r\n	<li>1000 Бонусных рублей, 150 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Играй в игру на сайте М.Видео;</li>\r\n	<li>Зарабатывай баллы;</li>\r\n	<li>Получи возможность выиграть приз.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(67, 'Акция Ашан: «Родной во всех отношениях!»', 'iPhone и 2 iPad', '2021-03-10 19:05:52', 'https://www.instagram.com/p/CLcFLEAlhxa/', 'uploads/фото компаний/auchan.jpg', 1, 0, '2021-03-09 17:06:10', '2021-03-09 17:06:10', 0, 'akciya-ashan-rodnoy-vo-vseh-otnosheniyah', '<p>Мы решили устроить для вас кулинарный конкурс, но это не просто конкурс с рецептами! Наверняка у каждого в семье есть особенное блюдо, с особенным названием и особенной историей!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>1 неделя - 10 подарочных карт АШАН на 4000 рублей;</li>\r\n	<li>2 неделя - 10 подарочных карт АШАН на 4000 рублей;</li>\r\n	<li>3 неделя - 3 суперпобедителя и возможность выиграть iPhone и 2 iPad.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Поделитесь с нами трогательной историей любимого семейного блюда с #АШАНроднойвовсехотношениях;</li>\r\n	<li>Выложите к себе на страничку фото или видео рецепт приготовления и финальное блюдо;</li>\r\n	<li>Каждую неделю мы вместе с блогерами будем выбирать 10 лучших работ.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(68, 'Акция Breesal: «Аромантика вашего дома»', 'Поездка на двоих в отель Rixos Krasnaya Polyana Sochi', '2021-03-14 19:07:31', 'https://breesal-promo.ru/', 'uploads/фото компаний/breesal.jpg', 1, 0, '2021-03-09 17:07:51', '2021-03-09 17:07:51', 0, 'akciya-breesal-aromantika-vashego-doma', '<p>Выиграй тур на двоих в отель Rixos Krasnaya Polyana Sochi!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Главный приз &ndash; Поездка на двоих в отель Rixos Krasnaya Polyana Sochi;</li>\r\n	<li>Еженедельный приз - Электронный сертификат по выбору обедителя &laquo;Дикая орхидея&raquo;, &laquo;Sunlight&raquo; &laquo;Lush&raquo;, &laquo;Pandora&raquo;, Lamoda, номиналом 3 500 рублей - 40 шт.;</li>\r\n	<li>Гарантированный приз &ndash; 2 эксклюзивных маски в социальной сети Instagram</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>Покупай Breesal на сумму от 100 рублей;</li>\r\n	<li>Регистрируй чек на сайте breesal-promo.ru;</li>\r\n	<li>Выигрывай романтические призы от Breesal.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(69, 'Акция Райтон: «10 лет Райтон»', '500 000 рублей на путешествие', '2021-12-14 19:10:14', 'https://raiton.ru/10-let-raiton/', 'uploads/фото компаний/rajton.jpg', 1, 0, '2021-03-09 17:10:40', '2021-03-09 17:10:40', 0, 'akciya-rayton-10-let-rayton', '<p>2021 особенно значимый для бренда Райтон! В этом году мы отмечаем нашу первую круглую дату - вот уже 10 лет мы дарим вам экологичный и комфортный сон и помогаем создавать гармоничные интерьеры! В течение года вас ждет три масштабных розыгрыша!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>500 000 рублей на путешествие, 1 приз;</li>\r\n	<li>Спальная система, 20 призов;</li>\r\n	<li>Диван, 20 призов;</li>\r\n	<li>Кровать, 80 призов;</li>\r\n	<li>Матрас, 60 призов;</li>\r\n	<li>Подушка или подарочный сертификат на продукцию, 350 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купите продукцию Райтон на сумму от 5000 рублей;</li>\r\n	<li>Зарегистрируйте покупку на странице акции и подпишись на соц.сети;</li>\r\n	<li>Участвуйте в двух розыгрышах призов;</li>\r\n	<li>Совершите покупки в течение периода акции на сумму от 50 000 рублей и участвуй в главном Розыгрыше.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(70, 'Акция Unilever и Магнит Косметик: «Марафон красивой кожи»', 'Электронный подарочный сертификат «Магнит Косметик» номиналом 2 000 рублей', '2021-04-06 19:12:17', 'https://www.promonado.ru/', 'uploads/фото компаний/unilever.jpg', 1, 0, '2021-03-09 17:12:33', '2021-03-09 17:12:33', 0, 'akciya-unilever-i-magnit-kosmetik-marafon-krasivoy-kozhi', '<p>С 10 марта 2021 года участвуй в акции от брендов &laquo;Чёрный Жемчуг&raquo;, &laquo;Чистая Линия&raquo;, &laquo;Love Beauty&amp;Planet&raquo;, &laquo;Бархатные Ручки&raquo;, &laquo;Сто рецептов красоты&raquo; и сети магазинов &laquo;Магнит Косметик&raquo;. Покупай продукцию, участвующую в акции, регистрируй чеки и получи возможность выиграть призы!</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Товары за 1 рубль - для получения товара за 1 рубль приобрети косметические маски брендов &laquo;Чёрный Жемчуг&raquo;, &laquo;Чистая Линия&raquo;, &laquo;Love Beauty&amp;Planet&raquo;, &laquo;Бархатные Ручки&raquo;, &laquo;Сто рецептов красоты&raquo; в торговой сети &laquo;Магнит Косметик&raquo; в количестве не менее 3 штук. Продукт с наименьшей ценой будет пробит за 1 рубль;</li>\r\n	<li>Главный приз &ndash; электронный подарочный сертификат &laquo;Магнит Косметик&raquo; номиналом 2 000 рублей &ndash; 100 шт.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ul>\r\n	<li>С 10 марта по 06 апреля 2020 года приобретай не менее 3-х единиц акционной продукции и получи один из товаров за 1 рубль.</li>\r\n	<li>Для участия в розыгрыше ценных призов продукцию брендов приобретай косметические маски брендов &laquo;Чёрный Жемчуг&raquo;, &laquo;Чистая Линия&raquo;, &laquo;Love Beauty&amp;Planet&raquo;, &laquo;Бархатные Ручки&raquo;, &laquo;Сто рецептов красоты&raquo; в торговой сети &laquo;Магнит Косметик&raquo; в количестве не менее 2 штук и получи чек.</li>\r\n	<li>Кассовый чек за покупку Продукции зарегистрируй чек через WhatsApp, отправив фотографию чека с QR-кодом на номер + 7 (918) 652 07 75.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(71, 'Акция Dove и Магнит Косметик: «Позволь им сиять»', '10 путевок в детский лагерь «Орленок»', '2021-04-06 19:14:34', 'https://idoveyou.ru/partners/magnit-kosmetik', 'uploads/фото компаний/dove.jpg', 1, 0, '2021-03-09 17:15:21', '2021-03-09 17:15:21', 0, 'akciya-dove-i-magnit-kosmetik-pozvol-im-siyat', '<p>Призы от Dove ждут вас в сети Магнит Косметик. Совершайте покупку продукции Dove в магазинах &laquo;Магнит Косметик&raquo;, загрузите чек на сайте акции с 10 марта по 6 апреля и примите участие в еженедельном розыгрыше призов.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>10 путевок в детский лагерь &laquo;Орленок&raquo;;</li>\r\n	<li>200 электронных денежных купонов &laquo;Магнит&raquo;.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Совершите покупку 2-х и более продуктов Dove в магазинах &laquo;Магнит Косметик&raquo;;</li>\r\n	<li>Зарегистририруйте покупку на сайте акции;</li>\r\n	<li>Участвуйте в розыгрыше призов.</li>\r\n</ol>', 0, '', '', '', '', '', '', '', ''),
(72, 'Акция Pantene и Магнит: «Выиграй слиток золота от Pantene!»', 'Слиток золота 999 пробы весом 100 граммов', '2021-05-04 19:16:48', 'https://pgbonus.ru/promos/pantene-mk', 'uploads/фото компаний/pantene-pro-v.jpg', 1, 0, '2021-03-09 17:17:10', '2021-03-09 17:17:10', 0, 'akciya-pantene-i-magnit-vyigray-slitok-zolota-ot-pantene', '<p>Мои волосы - моё сокровище. С 10 марта 2021 года участвуй в акции от Pantene и &laquo;Магнит&raquo;, регистрируй чек и выиграй призы.</p>\r\n\r\n<h2>Призы:</h2>\r\n\r\n<ul>\r\n	<li>Слиток золота 999 пробы весом 100 граммов, 1 приз;</li>\r\n	<li>Слиток золота 999 пробы весом 10 граммов, 10 призов;</li>\r\n	<li>Сертификат &laquo;Магнит Косметик&raquo; номиналом 1000 рублей, 100 призов.</li>\r\n</ul>\r\n\r\n<h2>Участие в акции:</h2>\r\n\r\n<ol>\r\n	<li>Купи 2 любых продукта Pantene в &laquo;Магнит Косметик&raquo;/&laquo;Магнит Гипермаркет&raquo; и сохрани чек;</li>\r\n	<li>Зарегистрируй чек в течение 96 часов на сайте акции;</li>\r\n	<li>Выиграй слиток золота или 1000 рублей на карту лояльности &laquo;Магнит Косметик&raquo;.</li>\r\n</ol>\r\n\r\n<h2>Сроки проведения акции:</h2>\r\n\r\n<ul>\r\n	<li>Общий срок проведения акции: с 10.03.2021, включая срок определения победителей;</li>\r\n	<li>Сроки совершения покупок и регистрации чеков: с 10.03.2021 по 04.05.2021 включительно.</li>\r\n</ul>', 0, '', '', '', '', '', '', '', ''),
(73, 'iphone', 'iphone', '2021-03-31 21:00:00', 'iphone', '', 1, 0, '2021-03-12 09:36:03', '2021-03-12 09:37:12', 0, 'iphone', '<p>iphone</p>', 1, '2', 'iphone', '', '<p>iphone</p>', 'iphone', '', '', ''),
(75, 'parshuk_', '50.000', '2021-03-16 21:00:00', 'https://www.instagram.com/parshuk_/?igshid=hhtdctdn2j7b', 'uploads/photo_2021-03-12 17.50.32-2.jpeg', 1, 1, '2021-03-12 11:40:12', '2021-03-25 17:25:18', 1, 'parshuk_', '<p>17&nbsp;марта 2021 пройдет розыгрыш в Instagram у блогера @parshuk_, он&nbsp;у себя в сторис разыграет 50.000 руб. и выберет 10 победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Михаила: &quot;В честь выхода нового трека, дарю вам кеш. Выполни условия, когда бутрик доешь&quot;</p>', 0, '1', 'parshuk', 'uploads/1-1-min.png', '<div class=\"text__title\">ЗАРЕГИСТРИРУЙТЕСЬ И ПРИМИТЕ УЧАСТИЕ В МАСШТАБНОМ РОЗЫГРЫШЕ ПОЛУЧИВ ВОЗМОЖНОСТЬ ВЫИГРАТЬ ДЕНЕЖНЫЙ ПРИЗ.</div>\r\n\r\n<div class=\"text__content\">Instagram блогер <span class=\"marker\">@parshuk_</span> разыгрывает 50.000 руб. Розыгрыш будет проходить 17 марта и у каждого будет возможность получить приз. Всего 10 победителей по 5.000 руб, которые будут выбраны на глазах всех его&nbsp;подписчиков с помощью рандомайзера и каждый победитель получит свой выигрыш.<br />\r\n<br />\r\nБлагодаря Вашей регистрации Вы также сможете, в дальнейшем, участвовать в розыгрышах от других организаторов, где будете иметь возможность выигрывать денежные и другие призы.<br />\r\n<br />\r\nВ момент регистрации на этом сайте и подтверждения Вашей кредитной карты Вы автоматически подписываетесь на услуги нашего сервиса и получаете 3 дня бесплатного участия в данном розыгрыше и всех иных представленных на нашей платформе wingift.org. Если вы продолжите подписку после 3-х дневного пробного периода у Вас будет доступ к услугам нашей платформы всего за 625 рублей, которые будут списываться раз в 14 дней. После списания 14-ти дневной оплаты нашей платформы вы сохраните доступ к услугам, которые доступны исключительно для участников, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</div>', 'parshuk_', '10', 'uploads/1-1-min.png', 'uploads/1-1-min.png'),
(76, '_agentgirl_', '250.000', '2021-03-25 17:55:52', 'https://www.instagram.com/_agentgirl_/?hl=ru', 'uploads/Ивелеева.jpg', 1, 1, '2021-03-18 13:41:11', '2021-03-25 17:55:52', 1, '_agentgirl_', '<p>9 марта 2021 пройдет розыгрыш в Instagram у блогера @_agentgirl_, она у себя в сторис разыграет 250.000 руб. и выберет 20&nbsp;победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Насти:&nbsp;&quot;День рождения у меня, а подарки получаете вы!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(77, 'gusein.gasanov', '400.000', '2021-03-25 17:54:42', 'https://www.instagram.com/gusein.gasanov/?hl=ru', 'uploads/Гусейн.jpg', 1, 1, '2021-03-18 13:45:36', '2021-03-25 17:54:42', 1, 'gusein.gasanov', '<p>8 марта 2021 пройдет розыгрыш в Instagram у блогера @gusein.gasanov, он&nbsp;у себя в сторис разыграет 400.000 руб. и выберет 20&nbsp;победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Гусейна:&nbsp;&quot;В честь&nbsp;праздника 8 марта хочу сделать подарок для наших прекрасных дам!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(78, 'timatiofficial', '150.000', '2021-03-25 17:53:26', 'https://www.instagram.com/timatiofficial/?hl=ru', 'uploads/Тимати.jpg', 1, 1, '2021-03-18 13:47:02', '2021-03-25 17:53:26', 1, 'timatiofficial', '<p>26&nbsp;марта 2021 пройдет розыгрыш в Instagram у блогера @timatiofficial, он&nbsp;у себя в сторис разыграет 150.000 руб. и выберет 20 победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Тимати:&nbsp;&quot;У крутых ребят должен быть крутой кеш и я его вручу лучшему!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(79, 'alfredo_auditore', '100.000', '2021-03-24 21:00:00', 'https://www.instagram.com/alfredo_auditore/?hl=ru', 'uploads/Альфредо.jpg', 0, 1, '2021-03-18 13:52:40', '2021-03-26 09:17:30', 1, 'alfredo_auditore', '<p>28&nbsp;марта 2021 пройдет розыгрыш в Instagram у блогера @alfredo_auditore, он&nbsp;у себя в сторис разыграет 100.000 руб. и выберет 10 победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Альфредо:&nbsp;&quot;Харизмой мир покорим вместе. Выполняй условия у меня на страничке и получай кеш!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(80, 'buzova86', '250.000', '2021-03-25 17:50:46', 'https://www.instagram.com/buzova86/?hl=ru', 'uploads/Бузова.jpg', 1, 1, '2021-03-18 13:54:59', '2021-03-25 17:50:46', 1, 'buzova86', '<p>14 марта 2021 пройдет розыгрыш в Instagram у блогера @maru_oru, она у себя в сторис разыграет 250.000 руб. и выберет 20&nbsp;победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.&nbsp;</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Оли:&nbsp;&quot;Ребята, всех с&nbsp;масленицей! Всех, кто взял участие будет шанс! Любите и будьте любимы!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(81, 'svinoblud', '50.000', '2021-03-25 17:00:14', 'https://www.instagram.com/svinoblud/?igshid=d29uopvy0e3l', 'uploads/свиноблуд.I08sR.jpg', 1, 1, '2021-03-19 14:25:08', '2021-03-25 17:00:14', 1, 'svinoblud', '<p>23 марта 2021 пройдет розыгрыш в Instagram у блогера @svinoblud, он&nbsp;у себя в сторис разыграет 50.000 руб. и выберет 10 победителей среди своих подписчиков. Все что нужно для участия это быть подписанным на страницу блогера и выполнить минимальные условия розыгрыша.&nbsp;</p>\r\n\r\n<p>Все очень просто и наша команда WingGift желает Вам удачи в этом розыгрыше!</p>\r\n\r\n<p>Пару слов от Андрея: &quot;Хочешь стать счастливчиком? Просто прими участие в моем розыгрыше! И денежки станут&nbsp;твоими!&quot;</p>', 0, '', '', '', '', '', '', '', ''),
(82, 'svinoblud', '50.000', '2021-03-22 21:00:00', '', '', 1, 0, '2021-03-19 14:29:52', '2021-03-20 14:22:55', 0, 'svinoblud', '', 1, '1', 'svinoblud', 'uploads/2-6.png', '<div class=\"text__title\">ЗАРЕГИСТРИРУЙТЕСЬ И ПРИМИТЕ УЧАСТИЕ В МАСШТАБНОМ РОЗЫГРЫШЕ ПОЛУЧИВ ВОЗМОЖНОСТЬ ВЫИГРАТЬ ДЕНЕЖНЫЙ ПРИЗ.</div>\r\n\r\n<div class=\"text__content\">Instagram блогер <span class=\"marker\">@svinoblud</span>&nbsp;разыгрывает 50.000 руб. Розыгрыш будет проходить 23 марта и у каждого будет возможность получить приз. Всего 10 победителей по 5.000 руб, которые будут выбраны на глазах всех его&nbsp;подписчиков с помощью рандомайзера и каждый победитель получит свой выигрыш.<br />\r\n<br />\r\nБлагодаря Вашей регистрации Вы также сможете, в дальнейшем, участвовать в розыгрышах от других организаторов, где будете иметь возможность выигрывать денежные и другие призы.<br />\r\n<br />\r\nВ момент регистрации на этом сайте и подтверждения Вашей кредитной карты Вы автоматически подписываетесь на услуги нашего сервиса и получаете 3 дня бесплатного участия в данном розыгрыше и всех иных представленных на нашей платформе wingift.org. Если вы продолжите подписку после 3-х дневного пробного периода у Вас будет доступ к услугам нашей платформы всего за 625 рублей, которые будут списываться раз в 14 дней. После списания 14-ти дневной оплаты нашей платформы вы сохраните доступ к услугам, которые доступны исключительно для участников, которые платят 14-ти дневный платеж за пользование нашей платформой и оповещение о актуальных розыгрышах в которых они могут принять участие.</div>', 'svinoblud', '10', 'uploads/2-6.png', 'uploads/2-6.png');
