INSERT INTO `reviews` (`id`, `name`, `image`, `content`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Марина', 'uploads/files/tes-3.jpg', 'Обожаю этот сервис, помимо того, что я каждый день узнаю что-то новое я еще могу следить за тем кто и когда проводит розыгрыши в Instagram и уже по своему желанию принимать в них участие. Очень рекомендую сервис, я всем довольна!', 1, '2021-02-05 10:52:35', '2021-02-28 08:59:02'),
(2, 'Николай', 'uploads/files/4.jpg', 'Узнал о WinGifts не так давно, но за это время понял, что сервис заслуживает моего внимания и с его помощью уже начал разбираться что такое соц. сети и как можно вести свой блог. Большое спасибо ребятам за их труд.', 1, '2021-02-05 10:56:52', '2021-02-28 08:58:53'),
(3, 'Алина', 'uploads/files/05.jpg', 'Частенько смотрю за всеми обновлениями и практически каждый раз нахожу для себя что-то интересное. Кстати, классно что сервис ищет и предоставляет информацию о том кто из блогеров сейчас что-то разыгрывает в Instagram, не нужно теперь подписывать на всех блогеров чтобы об этом узнавать.', 1, '2021-02-05 10:58:40', '2021-02-28 08:58:44'),
(4, 'Виктор', 'uploads/files/06.jpg', 'Пользуюсь WinGIfts уже 2 месяца и очень доволен. На прошлой неделе увидел тут информацию что блогер Альфредо у себя в Инстаграм разыгрывал деньги и перешел к нему на страничку чтобы разобраться что к чему, в итоге подписался на него еще и стал победителем, огромное спасибо ребятам за крутую инфу.', 1, '2021-02-05 10:59:39', '2021-02-28 08:58:36'),
(5, 'Алиса', 'uploads/files/team4.jpg', 'Давно хотела узнать как правильно нужно оформлять свою страничку в Instagram и перечитала много всяких статей в интернете пока не наткнулась на WinGifts и очень обрадовалась, потому что теперь не нужно тратить много времени на поиски информации. Класс, сервис точно стоит своих денег.', 1, '2021-02-05 11:05:58', '2021-02-28 08:58:16'),
(6, 'Виктория', 'uploads/files/img-3.png', 'Мне нравится что в WinGifts ребята реально заморачиваются и ищут прям всю-всю информацию о том кто и что разыгрывает в Instagram. Я лично очень люблю поучаствовать во всяких конкурсах, но кроме топовых блогеров никого не могла найти, а оказывается столько людей что-то разыгрывают, что стать победителем, на самом деле, шансов больше чем я думала. Спасибо WinGifts за такую классную функцию.', 1, '2021-02-05 11:08:35', '2021-02-28 08:58:08');
